INSERT INTO `encountertemplate` (`encountertemplate_name`, `createdatetime`, `encountertemplate_value`, `creator`) VALUES
('ABDOMINAL PAIN, NOS', '0001-01-01 00:00:00', '1. Inquiry re type of pain? \r\n2. Inquiry re duration of pain? \r\n3. Inquiry re location of pain? \r\n4. Inquiry re presence/absence of specific food intolerances? \r\n5. Inquiry re presence/absence of GI symptoms? \r\n6. Inquiry re presence/absence of fever? \r\n7. IF female, inquiry re menstrual history? \r\n8. Chest exam? \r\n9. Abdominal exam? \r\n10. Presence/absence of tenderness noted? \r\n11. IF female AND pelvic pain or lower left or right quadrant pain, pelvic exam? \r\n12. IF male AND pelvic pain or lower left or right quadrant pain, rectal exam? \r\n13. Urinalysis AND micro? \r\n14. IF abnormal urine, C & S? \r\n15. IF 2nd episode of abdominal pain NOS, C & S? ', 'Unknow'),
('ACNE VULGARIS', '0001-01-01 00:00:00', '1. IF on antibiotics (systemic or topical), duration noted on at least 50% of visits? \r\n2. IF on antibiotics (systemic or topical), type noted of visits? \r\n3. Radiation used in treatment by family physicians? \r\n4. Discussion re causes and treatment with patient? \r\n5. IF systemic antibiotics prescribed, follow-up within 6 weeks? \r\n6. IF "controlled", follow-up once per year? \r\n7. IF "severe" (failure to respond to treatment by family physician within 6 months), referral? ', 'Unknow'),
('ALCOHOLISM', '0001-01-01 00:00:00', '1. Alcohol intake, amount per day (when drinking)?\r\n2. Duration of problem?\r\n3. Inquiry re time missed from work?\r\n4. Blood pressure yearly?\r\n5. Chest exam yearly?\r\n6. Yearly comment re condition of skin?\r\n7. Abdominal exam yearly?\r\n8. CPE OR CNS examination within past two years?\r\n9. CBC yearly?\r\n10. Three of following done AT LEAST ONCE; serum protein(AG AND total), SGOT, SGPT, alkaline phosphatase,\r\nprothrombin time, bilirubin?\r\n11. Time since last drink before this office visit noted?\r\n12. Initiate education of patient (AA, Alanon, OR note that counselling was done)?\r\n13. Counselling OR referral to alcohol treatment agency for family member(s)?\r\n14. IF first diagnosis within past 2 years, follow-up within one month?', 'Unknow'),
('ALLERGIC REACTION', '0001-01-01 00:00:00', '1. Inquiry re type OR description of reaction?\r\n2. Inquiry re site of reaction?\r\n3. Inquiry re severity of reaction?\r\n4. Inquiry re possible causes (eg. food, medications, bites, inhalation)?\r\n5. Examination of affected area(s)?\r\n6. IF "severe" reaction, heart rate AND rymthm?\r\n7. Blood pressure?\r\n8. Chest exam?\r\n9. Discussion re allergies OR on chart (3 minute)?\r\n10. IF patient has specific drug allergy, bracelet?\r\n11. IF patient has specific drug allergy, is this recorded in a\r\nconsistent area of the chart?', 'Unknow'),
('AMMENORRHEA - PRIMAR', '0001-01-01 00:00:00', '1. Family history? \r\n2. Growth history? \r\n3. Sexual development history (secondary sexual characteristics)? \r\n4. No period by age 17? \r\n5. Description of breasts, pubic and axillary hair? \r\n6. Pelvic exam OR referral? \r\n7. Referral by age 18? ', 'Unknow'),
('ANEMIA, NYD', '0001-01-01 00:00:00', '*** NOTE ***\r\nNon-pregnant \r\n1. Inquiry re blood loss? \r\n2. Inquiry re diet? \r\n3. CPE within 6 months? \r\n4. On presenting visit, at least three of following? \r\nblood pressure \r\npulse \r\nabdominal exam \r\nrectal exam \r\n5. Hb OR hematocrit? \r\n6. IF no history of blood loss as cause, blood smear for indices? \r\n7. IF black patient, sickle cell screen? \r\n8. IF male over 19, hemoglobin OR IF female over 17, hemoglobin \r\n9. IF macrocytic indices OR smear (pancytopenia, macro-ovalocytosis, hypersegmentation of neutrophils), folate AND B12 test? \r\n10. IF microcytic indices OR smear microcytic, hypochromic) AND no obvious cause for bleeding, stool for occult blood? \r\n11. IF melena stool OR occult blood positive, barium enema? \r\n12. IF GI symptoms OR upper GI bleeding, UGI series? \r\n13. IF vitamin B12 injections given, documented B12 deficiency?\r\n14. IF iron therapy used, documented iron deficiency? \r\nSerum ferritin OR hemoglobin microcytic smear OR low indices (MCV and MCHC)? ', 'Unknow'),
('ANIMAL BITES', '0001-01-01 00:00:00', '1. Inquiry re what kind of animal? \r\n2. Inquiry re animal provoked or not? \r\n3. Description of wound? \r\n4. IF no tetanus toxoid within 10 years, injection given? \r\n5. IF animal unprovoked, comment re rabies risk? ', 'Unknow'),
('ANKYLOSING SPONDYLIT', '0001-01-01 00:00:00', '1. Inquiry re presence/absence of pain? \r\n2. Inquiry re history of stiffness? \r\n3. Yearly comment re stiffness? \r\n4. Yearly comment re range of movement? \r\n5. Yearly comment re presence/absence of deformity? \r\n6. HLA-B27 positive AND X-ray report positive OR consultant''s report positive? \r\n7. Oral corticosteroids started in primary care? \r\n8. IF on any medication, follow-up yearly? ', 'Unknow'),
('ANXIETY', '0001-01-01 00:00:00', '1. Statement re symptoms?\r\n2. Inquiry re duration of symptoms?\r\n3. Inquiry re precipitating factors?\r\n4. IF physical complaints noted, evidence of examination of affected area?\r\n5. IF anxiolytic agents used, amount and duration recorded?\r\n6. IF first prescription for medication, follow-up within 2 weeks?\r\n7. Counselling OR referral?', 'Unknow'),
('ARRHYTHMIA (CARDIAC)', '0001-01-01 00:00:00', '1. Inquiry re frequency of chest discomfort or pain? \r\n2. Inquiry re duration of chest discomfort or pain? \r\n3. Inquiry re frequency of palpitations? \r\n4. Inquiry re duration of palpitations? \r\n5. Inquiry re precipitating factors (coffee, tea, alcohol)? \r\n6. Inquiry re medications taken prior to occurrence? \r\n7. Blood pressure? \r\n8. Cardiac rate AND rhythm? \r\n9. Chest exam? \r\n10. ECG on first visit for this problem? \r\n11. IF on digoxin OR diuretics, electrolytes? \r\n12. IF on digoxin AND new arrhythmia present, digoxin level? \r\n13. ECG OR description of irregularity on chart? \r\n14. IF arrhythmia present at time of examination, treatment with medication OR reassurance OR referral? \r\n15. Advice re precipitating factors (eg. coffee, tea, alcohol, stress factors)? \r\n16. IF paroxysmal atrial tachycardia, inquiry re stress factors? \r\n17. Follow-up until specific diagnosis made OR referral? ', 'Unknow'),
('ARTHRITIS', '0001-01-01 00:00:00', '(less than one month - multiple joints)\r\n1. Inquiry re duration of symptoms?\r\n2. Location of joint pains noted?\r\n3. Description of nature OR severity of pain?\r\n4. Inquiry re aggravating OR precipitating factors?\r\n5. Description of inflammation OR swelling?\r\n6. Description of range of movement?\r\n7. On OR before second visit for same problem, CBC?\r\n8. On OR before second visit for same problem, ESR?\r\n9. On OR before second visit for same problem, anti-nuclear factor (i.e. ANF, ANA)?\r\n10. On OR before second visit for same problem, rheumatoid arthritis factor (i.e. RF, RA)?\r\n11. Were systemic steroids prescribed?\r\n12. Advice re rest OR restrict movement of joint?\r\n13. Follow-up within 2 weeks?\r\n14. IF within 1 year of visit for peptic ulcer disease, were anti-inflammatory agents prescribed?', 'Unknow'),
('ARTHRITIS, NYD OR NO', '0001-01-01 00:00:00', '** NOTE **\r\nless than one month - multiple joints \r\n1. Inquiry re duration of symptoms? \r\n2. Location of joint pains noted? \r\n3. Description of nature OR severity of pain? \r\n4. Inquiry re aggravating OR precipitating factors? \r\n5. Description of inflammation OR swelling? \r\n6. Description of range of movement? \r\n7. On OR before second visit for same problem, CBC? \r\n8. On OR before second visit for same problem, ESR? \r\n9. On OR before second visit for same problem, anti-nuclear factor (i.e. ANF, ANA)? \r\n10. On OR before second visit for same problem, rheumatoid arthritis factor (i.e. RF, RA)? \r\n11. Were systemic steroids prescribed? \r\n12. Advice re rest OR restrict movement of joint? \r\n13. Follow-up within 2 weeks? \r\n14. IF within 1 year of visit for peptic ulcer disease, were anti-inflammatory agents prescribed? ', 'Unknow'),
('ARTHRITIS, RHEUMATOI', '0001-01-01 00:00:00', '** NOTE **\r\nThese questions apply only to PREVIOUSLY DIAGNOSED rheumatoid arthritis. \r\n1. Inquiry re pain? \r\n2. Inqiury re stiffness? \r\n3. Inquiry re fatigue? \r\n4. Yearly comment re swollen joints? \r\n5. Yearly comment re limitation of movement? \r\n6. Follow-up at least once per year? \r\n7. IF patient on NSAIDS OR chloroquine OR penicillamine OR methotrexate OR gold (myochrysine), follow-up at least 2 times per year? \r\n8. Note at least once yearly re how patient coping? \r\n9. Was methotrexate OR gold OR oral corticosteroids started by family doctor (search back 3 months only)? \r\n10. IF taking chloroquine, ophthamological consultation AND evidence of opthalmological follow-up yearly? ', 'Unknow'),
('ASTHMA', '0001-01-01 00:00:00', '1. Inquiry re previous episodes? \r\n2. Inquiry re family history OR on chart (3 minute)? \r\n3. Inquiry re occupational history OR on chart (3 minute)? \r\n4. Drugs used for asthma recorded? \r\n5. Amount and duration of asthma drugs recorded? \r\n6. Inquiry re allergies OR on chart (3 minute)? \r\n7. Inquiry re duration of current episode? \r\n8. Description of breathing (eg. wheezing, respiratory distress)? \r\n9. Description of breath sounds? \r\n10. IF steroids used in acute attack, was dosage decreased within 10 days? \r\n11. Wheezing present in history or physical exam? \r\n12. IF smoker, advice re smoking? \r\n13. Advice re avoidance of allergens? \r\n14. Advice re avoidance of precipitating factors? \r\n15. IF on medication for an acute episode, follow-up weekly? \r\n16. Was beta-blocker prescribed? \r\n17. Were parasympathomimetics prescribed? ', 'Unknow'),
('ATROPHIC VAGINITIS', '0001-01-01 00:00:00', '1. Inquiry re at least one of following? \r\ndyspareunia \r\ndysuria \r\nspotting \r\nvaginal itch \r\n2. Description of vulva AND/OR vagina? \r\n3. Pap smear for karyopyknotic index? \r\n4. IF dysuria, urinalysis AND micro? \r\n5. Vaginal C & S? \r\n6. IF topical agent used, was it Premarin/conjugated estrogen OR dienestrol cream? \r\n7. IF oral estrogen therapy used, follow-up within one year? \r\n8. IF sexual dysfunction OR dyspareunia identified, counselling? ', 'Unknow'),
('BASAL AND SQUAMOUS C', '0001-01-01 00:00:00', '1. Inquiry re duration of lesion?\r\n2. Location of lesion noted?\r\n3. Size of lesion noted?\r\n4. Surgical pathology biopsy OR referral?\r\n5. IF not referred, pathology report positive?\r\n6. Excision OR dessication OR cryosurgery OR referral?\r\n7. IF not referred, follow-up within 1 month?', 'Unknow'),
('BILIARY COLIC', '0001-01-01 00:00:00', '1. Inquiry re at least three of following?\r\npain, description\r\nAND\r\nlocation\r\nfood intolerance\r\nrecurrence\r\nfever\r\n2. Abdominal exam?\r\n3. Chest exam?\r\n4. Heart rate AND rhythm?\r\n5. Blood pressure?\r\n6. CBC?\r\n7. SGOT, serum bilirubin, alkaline phosphatase?\r\n8. Gall bladder X-ray OR ultrasound?\r\n9. Advice re low-fat diet?\r\n10. One follow-up within 1 month?\r\n11. IF recurrent (2nd or greater episode), referral?', 'Unknow'),
('BLEPHARITIS', '0001-01-01 00:00:00', '1. Inquiry re symptoms?\r\n2. Duration of symptoms noted?\r\n3. Fluorinated steroids used?\r\n4. Advice re eye care?', 'Unknow'),
('BREAST LUMP', '0001-01-01 00:00:00', '1. Inquiry duration? \r\n2. Inquiry re presence/absence of pain? \r\n3. Inquiry re changes relative to menstrual cycle? \r\n4. Size of lump noted? \r\n5. Location of lump noted, specific description OR diagram?\r\n6. Presence/absence of axillary nodes? \r\n7. Referral OR follow-up visit within 4 weeks? \r\n8. IF not previously referred AND lump has not changed OR is larger, one of following done? \r\nreferral \r\naspiration \r\nmammogram \r\nexcision ', 'Unknow'),
('BRONCHITIS,ACUTE', '0001-01-01 00:00:00', '1. Comment re cough? \r\n2. Comment re sputum? \r\n3. Chest exam? \r\n4. Temperature recorded? \r\n5. IF antibiotics used, dose AND duration recorded (2/3 of the time)? \r\n6. IF smoker, advice re smoking? \r\n7. IF narcotic syrup used, was it prescribed more than once within 30 days? ', 'Unknow'),
('BRONCHITIS,CHRONIC', '0001-01-01 00:00:00', '1. Occupation on chart (3 minute)? \r\n2. Smoking history on chart (3 minute)? \r\n3. Cough productive OR note re presence/absence of change in amount of sputum? \r\n4. Chest breath sounds? \r\n5. CPE at least every two years with detailed description of chest (3 of 6 respiratory signs)? \r\n6. Chest X-ray (2 views) within 3 years? \r\n7. IF patient fails to improve after 21 days continuous medication, chest X-ray? \r\n8. Does patient produce sputum 6 months of the year? \r\n9. IF antibiotics used, dose AND durtion recorded (2/3 of visits)? \r\n10. IF smoker, advice re smoking? \r\n11. Follow-up twice per year? \r\n12. Sedatives, hypnotics, narcotics or antihistamines used? ', 'Unknow'),
('BRONCHOPNEUMONIA', '0001-01-01 00:00:00', '1. One of more of following?\r\ncough\r\ndyspnea (shortness of breath)\r\nfever\r\n2. Duration of symptoms noted?\r\n3. Chest exam?\r\n4. Rales in chest?\r\n5. Chest X-ray within one day of diagnosis?\r\n6. IF patient has not improved within 7 days, chest X-ray?\r\n7. IF initial X-ray is positive, repeat within 30 days?\r\n8. Positive X-ray OR rales on examination?\r\n9. IF antibiotics used, dose AND duration recorded, (2/3 of visits)?\r\n10. IF X-ray indicates mycopolasma pneumonia, tetracycline or erythromycin used?\r\n11. Follow-up within one week?', 'Unknow'),
('BURSITIS', '0001-01-01 00:00:00', '1. Inquiry re pain OR swelling? \r\n2. Inquiry re location? \r\n3. Inquiry re duration? \r\n4. Description of site of lesion (eg. redness, swelling, fluctuation)? \r\n5. IF infected OR if aspirated OR if I&D done, specimen sent for C&S? \r\n6. IF NSAID prescribed, one follow-up within 1 month? ', 'Unknow'),
('CELLULITIS', '0001-01-01 00:00:00', '1. Inquiry re duration? \r\n2. Site of lesion noted? \r\n3. Extent/size of lesion noted? \r\n4. Temperature recorded? \r\n*** NOTE *** \r\nIF the lesion is larger than 5 inches in diameter OR this is the third or more episode, then questions 5 through 8 apply. \r\n5. IF above, WBC on chart? \r\n6. IF above, urinalysis on chart? \r\n7. IF above, C & S of lesion? \r\n8. IF above, fasting blood sugar within one year? \r\n9. Antibiotics used for at least 7 days? \r\n10. IF antibiotic used, type recorded? \r\n11. IF antibiotic used, amount recorded? \r\n12. Follow-up within 7 days? ', 'Unknow'),
('CEREBRAL CONCUSSION', '0001-01-01 00:00:00', '1. Type of trauma described? \r\n2. Comment re severity of injury? \r\n3. Time since injury? \r\n4. Presence/absence of change in sensorium since injury? \r\n5. History of loss of consciousness? \r\n6. Neurological exam? \r\n7. Examination of site of injury? \r\n8. Skull X-ray? \r\n9. IF patient not admitted, head injury routine sheet OR instructions? \r\n10. Narcotics or sedatives used? \r\n11. Admission to hospital OR referral? ', 'Unknow'),
('CERVIX, CARCINOMA IN', '0001-01-01 00:00:00', '1. Inquiry re vaginal discharge, within one month?\r\n2. Inquiry re presence/absence of vaginal spotting, within one month?\r\n3. Description of cervix, within one month?\r\n4. Positive Pap smear?\r\n5. IF class IV smear or worse, referral within one month?', 'Unknow'),
('CHEST PAIN-NYD (>18', '0001-01-01 00:00:00', '1. Location of pain noted? \r\n2. Duration of pain noted? \r\n3. Response to exercise OR posture noted? \r\n4. History of cough OR response to breathing noted? \r\n5. Response to time of eating OR type of food noted? \r\n6. Chest exam? \r\n7. Blood pressure? \r\n8. Heart rate AND rhythm? \r\n9. Presence/absence of chest wall tenderness noted? \r\n10. IF exercise related AND chest not tender, ECG done within 3 days? \r\n11. IF rales OR rhonchi OR dullness in chest, X-ray ordered within 3 days? \r\n12. Statement that there is no cardiac cause OR ECG normal, on this visit OR follow-up within one month? ', 'Unknow'),
('CHICKEN POX', '0001-01-01 00:00:00', '1. Inquiry re duration of symptoms? \r\n2. Description of rash? \r\n3. Blister OR papular OR vesicular rash? \r\n4. ASA used? ', 'Unknow'),
('CHRONIC PROSTATITIS', '0001-01-01 00:00:00', '1. Inquiry re at least 3 of following? \r\ndysuria\r\nfrequency\r\nperineal pain\r\npainful sexual activity\r\nurethral discharge \r\nlow back pain\r\nnocturia \r\n2. Abdominal exam? \r\n3. Rectal exam?\r\n4. Description of prostate (size and consistency)? \r\n5. Urine C & S? \r\n6. Septra OR tetracycline OR ampicillin OR\r\nerythromycin used? \r\n7. Antibiotic used for at least 2 weeks?\r\n8. One follow-up? \r\n9. IF symptoms continue beyond one month OR\r\npyuria for more than one month OR  bacteriuria for more than one month, consultation and/or referral? ', 'Unknow'),
('CLUSTER HEADACHE', '0001-01-01 00:00:00', '1. History of attacks in clusters? \r\n2. Attacks acute AND short duration AND recurring several times in 24 hours? \r\n3. Description of headache including two of following? \r\nfacial flushing OR sweating \r\nunilateral lacrimation \r\nnasal congestion \r\n4. Blood pressure? \r\n5. Neurological exam, including note re cranial nerves? \r\n6. One follow-up within 6 months? \r\n7. IF on medication, one follow-up within one month? ', 'Unknow'),
('CONGESTIVE HEART FAI', '0001-01-01 00:00:00', '1. Inquiry re at least two of following? \r\nshortness of breath \r\nswollen ankles \r\nparoxysmal nocturnal dyspnea \r\nexercise intolerance \r\n2. Current medication list? [HA2 ]> \r\n3. Chest exam? \r\n4. Weight recorded on at least 50% of visits? \r\n5. Blood pressure? \r\n6. Comment on ankles OR jugular venous pressure (J.V.P. or J.V.D.)? \r\n7. Heart rate AND rhythm? \r\n8. ECG within 1 year prior OR within 2 weeks after first diagnosis? \r\n9. IF on diuretics, electrolytes done on 50% of visits? \r\n10. BUN done on 50% of visits? \r\n11. Hemoglobin OR indices (hematocrit, MCV, MCHC) done on 50% of visits? \r\n12. Diuretics prescribed? \r\n13. IF on diuretics, amount and duration recorded? \r\n14. Rest recommended? \r\n15. Advice re diet (eg. low salt)? \r\n16. Follow-up weekly until physician notes "improved" or "stable"? \r\n17. Narcotics prescribed? ', 'Unknow'),
('CONJUNCTIVITIS', '0001-01-01 00:00:00', '1. Inquiry re itching OR discharge?\r\n2. Inquiry re duration?\r\n3. Description of conjunctiva?\r\n4. IF ophthalmic steroids used, was cornea stained with fluorescein?', 'Unknow'),
('CONSTIPATION, RECURR', '0001-01-01 00:00:00', '*** NOTE ***\r\nPatient over 30 years old with a prior history of constipation. \r\n1. Inquiry re change in bowel movement? \r\n2. Inquiry re diet? \r\n3. Inquiry re drugs? \r\n4. Abdominal exam? \r\n5. Rectal exam? \r\n6. Stool for occult blood? \r\n7. IF less than 3 months duration, barium enema? \r\n8. Infrequent AND/OR difficult bowel movements? \r\n9. Instructions re increase in roughage OR fibre OR bran? \r\n10. One follow-up OR specific diagnostic statement within 3 months? ', 'Unknow'),
('CONTACT DERMATITIS', '0001-01-01 00:00:00', '** NOTE **\r\nIncludes poison ivy. \r\n1. Inquiry re duration? \r\n2. Inquiry re itching? \r\n3. Inquiry re exposure to irritants? \r\n4. Location of rash noted? \r\n5. IF oral prednisone used, no more than 7 days? \r\n6. IF oral prednisone used, one follow-up visit or phone call? ', 'Unknow'),
('CORONARY ARTERY DISE', '0001-01-01 00:00:00', '1. Comment on one of the following with each visit?\r\nangina\r\nshortness of breath\r\nankle edema\r\n2. Yearly comment on pain OR nitroglycerines taken?\r\n3. Yearly comment on exercise tolerance?\r\n4. Blood pressure of each visit for this diagnosis (at least 75%)?\r\n5. One CPE by family physician in 2 years?\r\n6. ECG on chart within 2 years?\r\n7. Drug list every 12 months?\r\n8. Dosage of prescribed drugs every 12 months (at least 75%)?\r\n9. IF obesity noted, advice re weight loss?\r\n10. Follow-up at least twice per year?\r\n11. IF congestive heart failure AND use of non-steroidal anti-inflammatory agents OR beta-blockers OR calcium channel blockers, was there a justification statement?', 'Unknow'),
('CYSTITIS', '0001-01-01 00:00:00', '1. Inquiry re urinary symptoms, one or more of following? \r\nurgency \r\nfrequency \r\ndysuria \r\nhematuria \r\n2. Inquiry re duration of symptoms? \r\n3. Urine dip for protein AND blood OR urinalysis OR urine culture? \r\n4. Positive culture OR two of following present? \r\nurgency \r\nfrequency \r\ndysuria \r\nhematuria \r\n5. Antibiotic used AND was it one of the sulfas, ampicillin, Septra/Bactrim, or tetracycline? \r\n6. One follow-up AND repeat urinalysis OR\r\nculture? \r\n7. Was a negative culture on chart at end of treatment? \r\n8. Was streptomycin or chloromycetin used? ', 'Unknow'),
('CYSTITIS, RECURRENT', '0001-01-01 00:00:00', '1. Comment re any urinary symptoms?\r\n2. Urinalysis or dipstick?\r\n3. Urine for C & S?\r\n4. BUN on chart (3 minute)?\r\n5. IF 3 or more episodes within 3 months, urine culture for TB (acid-fast bacilli)?\r\n6. At least one urinary symptom present OR positive culture?\r\n7. IF culture done, do antibiotics reflect culture \r\nsensitivities?\r\n8. IF child with 2 or more UTI, IVP AND voiding cystogram, OR referral?\r\n9. IF adult female with 3 or more culture proven UTI within\r\n2 years, IVP AND (BUN or Creatinine) OR referral?\r\n10. IF abnormal IVP OR (BUN or Creatinine), referral?', 'Unknow'),
('DDD, CERVICAL', '0001-01-01 00:00:00', '1. Inquiry re neck pain?\r\n2. Inquiry re presence/absence of trauma?\r\n3. Inquiry re one of following?\r\npain referred to shoulder and arm muscle weakness of forearm paresthesia\r\n4. Comment on reflexes in arms?\r\n5. Comment on presence/absence of weakness in upper extremity muscles?\r\n6. Comment re range of movement of neck OR within 1 year?\r\n7. Cervical spine X-ray on chart (3 minute)?\r\n8. Positive X-ray diagnosis?\r\n9. IF first visit for this episode, follow-up within 6 weeks?\r\n10. Cervical collar used continuously for more than 1 month?', 'Unknow'),
('DEAFNESS', '0001-01-01 00:00:00', '1. Inquiry re duration of hearing loss?\r\n2. Inquiry re trauma OR infection OR industrial exposure, on chart (3 minute)?\r\n3. Comment on ear drums at least once per year?\r\n4. Audiogram OR referral to ENT on chart (3 minute)?', 'Unknow'),
('DEGENERATIVE ARTHRIT', '0001-01-01 00:00:00', '1. Were oral corticosteroids (steroids) used? ', 'Unknow'),
('DEGENERATIVE DISC DI', '0001-01-01 00:00:00', '1. Inquiry re low back pain, at least one of following? \r\nduration \r\nlocation \r\nradiation \r\n2. Comment on movement of back, at least one of following? \r\nflexion \r\nextension \r\nlateral flexion \r\nrotation \r\n3. Lumbar X-ray (3 views) on chart (3 minute)? \r\n4. Positive X-ray of lumbar spine on chart (3 minute)? \r\n5. IF narcotic analgesic used, justification statement? \r\n6. Back exercises AND/OR back care instructions? ', 'Unknow'),
('DEPRESSION', '0001-01-01 00:00:00', '1. Inquiry re medications/drugs taken?\r\n2. Inquiry re duration of problem?\r\n3. Inquiry re suicidal thoughts OR statement that depression is mild or minor?\r\n4. IF physical complaints noted, evidence of examination of affected area?\r\n5. CPE within 2 years?\r\n6. Comment on mood OR appearance OR affect?\r\n7. IF antidepressant given, follow-up within 2 weeks?\r\n8. IF first prescription for antidepressant, was duration noted AND was duration\r\n9. IF no antidepressants given, follow-up within 1 month?\r\n10. IF "suicidal", referral OR hospitalization?\r\n11. Discussion re stress factors?\r\n12. Were barbiturates prescribed?', 'Unknow'),
('DERMATOPHYTOSIS - RI', '0001-01-01 00:00:00', '1. Site noted? \r\n2. Extent noted? \r\n3. IF griseofulvin prescribed, skin scraping for C & S? \r\n4. Topical antifungal agent used? \r\n5. IF griseofulvin used, were topical antifungal agents tried for 1 month first? \r\n6. One follow-up within 3 weeks? \r\n7. IF griseofulvin used, CBC within 3 months? ', 'Unknow'),
('DIABETES MELLITUS, A', '0001-01-01 00:00:00', '1. Inquiry re family history of diabetes on chart (3 minute)? \r\n2. Duration of disease OR starting date on chart (3 minute)? \r\n3. Inquiry re one of following on each visit? \r\nurine sugars \r\nblood sugars \r\ndietary management \r\npatient feels well or ill \r\n4. Weight recorded (at least 75% of visits)? \r\n5. Urine glucose each visit? \r\n6. Comment re cardiovascular system AND blood pressure yearly? \r\n7. Examination of fundi yearly? \r\n8. IF on oral hypoglycemics, at least one blood sugar recorded yearly? \r\n9. IF on insulin, at least two blood sugars recorded yearly? \r\n10. BUN OR creatinine on chart (3 minute)? \r\n11. IF diabetes first diagnosed within past 2 years, evidence of 2 fasting blood sugars > 8.8 mmol/L OR random sugar > 13.8 mmol/L prior to treatment? \r\n12. Diabetic diet - caloric intake noted on chart (3 minute)? \r\n13. Evidence of dietary counselling by a health professional on chart (3 minute)? \r\n14. IF newly diagnosed, follow-up within one month? \r\n15. IF on diet alone, follow-up at least once yearly? \r\n16. IF on oral hypoglycemic OR insulin, follow-up at least twice yearly? \r\n17. Inquiry re sexual dysfunction on chart (3 minute)? \r\n18. IF acetohexamide or chlorpropramide used (Glyburide and Diabeta are OK), was BUN > 9 mmol/L OR was creatinine > 140 mmol/L? \r\n19. IF no ketones in serum or urine, was dietary therapy tried prior to starting oral hypoglycemic? ', 'Unknow'),
('DIABETES MELLITUS, J', '0001-01-01 00:00:00', '1. At least every 6 months, comment re one of following? \r\npolyuria \r\npolydipsia \r\nweight loss \r\n2. Description of fundi at least once yearly OR evidence on chart (3 minute) that patient is followed by an opthalmologist? \r\n3. Yearly fasting blood sugar? \r\n4. Urinalysis on at least 75% of visits? \r\n5. Insulin dosage noted at least once yearly? \r\n6. Evidence that home monitoring of urine glucose OR blood glucose is occurring? \r\n7. Evidence of dietary counselling (CDA diet or diabetic education centre referral) on chart (3 minute)? \r\n8. Follow-up at least twice yearly? \r\n9. Evidence of discussion re effects on normal life (eg. family, friends, activities) at least once yearly? ', 'Unknow'),
('DIABETES MELLITUS, T', '0001-01-01 00:00:00', '1. Inquiry re family history of diabetes on chart (3 minute)?\r\n2. Duration of disease OR starting date on chart (3 minute)?\r\n3. Inquiry re one of following on each visit? \r\nurine sugars blood sugars dietary management patient feels well or ill\r\n4. Weight recorded (at least 75% of visits)?\r\n5. Urine glucose each visit?\r\n6. Comment re cardiovascular system AND blood pressure yearly?\r\n7. Examination of fundi yearly?\r\n8. IF on oral hypoglycemics, at least one blood sugar recorded yearly?\r\n9. IF on insulin, at least two blood sugars recorded yearly?\r\n10. BUN OR creatinine on chart (3 minute)?\r\n11. IF diabetes first diagnosed within past 2 years, evidence of 2 fasting blood sugars > 8.8 mmol/L OR random sugar > 13.8 mmol/L prior to treatment?\r\n12. Diabetic diet - caloric intake noted on chart (3 minute)?\r\n13. Evidence of dietary counselling by a health professional on chart (3 minute)?\r\n14. IF newly diagnosed, follow-up within one month?\r\n15. IF on diet alone, follow-up at least once yearly?\r\n16. IF on oral hypoglycemic OR insulin, follow-up at least twice yearly?\r\n17. Inquiry re sexual dysfunction on chart (3 minute)?\r\n18. IF acetohexamide or chlorpropramide used (Glyburide and Diabeta are OK), was BUN > 9 mmol/L OR was creatinine > 140 mmol/L?\r\n19. IF no ketones in serum or urine, was dietary therapy tried prior to starting oral hypoglycemic?', 'Unknow'),
('DIAPER RASH', '0001-01-01 00:00:00', '1. Inquiry re duration?\r\n2. Description of rash?\r\n3. IF monilia, comment on mouth?\r\n4. IF monilia, topical antifungal used?\r\n5. Discussion re cleaning at diaper changing?\r\n6. IF "severe", follow-up within 1 month?\r\n7. Were fluorinated steroids used?\r\n8. IF thrush also present, oral mycostatin used?', 'Unknow'),
('DIARRHEA, MULTIPLE V', '0001-01-01 00:00:00', '1. Inquiry re frequency? \r\n2. Inquiry re duration? \r\n3. Inquiry re diet? \r\n4. Inquiry re medications? \r\n5. Inquiry re travel? \r\n6. Inquiry re blood in stool? \r\n7. Inquiry re fever? \r\n8. Inquiry re weight loss? \r\n9. Inquiry re nausea OR abdominal cramps OR pain? \r\n10. Abdominal exam? \r\n11. Rectal exam? \r\n12. Weight noted at least once? \r\n13. Stool for C & S? \r\n14. Stool for ova and parasites? \r\n15. CBC? \r\n16. ESR? \r\n17. Sigmoidoscopy OR colonoscopy OR referral? \r\n18. Barium enema? \r\n19. IF barium enema negative, UGI series with small bowel follow through? \r\n20. IF not improved within 6 months OR specific diagnosis not noted on chart, referral? ', 'Unknow'),
('DIVERTICULITIS', '0001-01-01 00:00:00', '1. Inquiry re abdominal pain?\r\n2. Inquiry re at least one of following?\r\nconstipation\r\ndiarrhea\r\nrectal bleeding\r\nregularity\r\n3. Inquiry re food intolerances?\r\n4. Abdominal exam?\r\n5. Rectal exam?\r\n6. Stool for occult blood OR within 1 year?\r\n7. Barium enema on chart (3 minute)?', 'Unknow'),
('DIZZINESS, NYD', '0001-01-01 00:00:00', '1. Inquiry re details of episode?\r\n2. Inquiry re duration of episode?\r\n3. Inquiry re presence/absence of precipitating factors?\r\n4. Inquiry re presence/absence of medications?\r\n5. Blood pressure?\r\n6. Heart rate AND rhythm?\r\n7. Ear exam?\r\n8. Comment on Rhomberg OR reflexes OR nystagmus?\r\n9. IF on diuretics, electrolytes tested?\r\n10. IF problem persists, on second visit blood sugar AND CBC?\r\n11. IF heart irregular, ECG OR Holter monitor?\r\n12. IF condition persists for more than 3 months AND specific diagnosis is made, referral?', 'Unknow'),
('DYSMENORRHEA', '0001-01-01 00:00:00', '1. Menstrual history?\r\n2. Inquiry re urinary symptoms?\r\n3. Inquiry re painful periods?\r\n4. IF sexually active, pelvic exam with comment on cervix?\r\n5. Abdominal exam?\r\n6. IF vaginal discharge present, C & S?\r\n7. Follow-up once within 4 months?', 'Unknow'),
('DYSPLASIA OF CERVIX', '0001-01-01 00:00:00', '1. Pap smear at least yearly? \r\n2. IF uterus not removed, yearly follow-up? \r\n3. IF present less than one year, record of follow-up time? ', 'Unknow'),
('ECTOPIC PREGNANCY', '0001-01-01 00:00:00', '1. Inquiry re presence/absence of lower abdominal pain?\r\n2. Inquiry re date of last menstrual period?\r\n3. Inquiry re presence/absence of vaginal bleeding?\r\n4. Pelvic exam?\r\n5. Blood pressure AND pulse?\r\n6. IF purulent vaginal discharge, C & S?\r\n7. Abdominal exam?\r\n8. Pregnancy test?\r\n9. IF pregnancy test negative, Beta-HCG?\r\n10. IF not referred or admitted, pelvic ultrasound?\r\n11. Positive pregnancy test OR positive Beta-HCG?\r\n12. Referral OR admission?', 'Unknow'),
('ECZEMA, CONTACT DERM', '0001-01-01 00:00:00', '1. Inquiry re duration? \r\n2. Presence/absence of family history of eczema OR on chart (3 minute)? \r\n3. IF over 5 years, inquiry re stress factors? \r\n4. Description of lesion? \r\n5. Location and extent? \r\n6. Topical steroids used? \r\n7. Systemic steroids initiated by family doctor? \r\n8. Discussion re prognosis of disease? \r\n9. One follow-up? \r\n10. IF acute AND failure to respond within 6 weeks, referral?\r\n11. IF child, occulsive dressing for 8 hours or more per 24 hours? \r\n12. IF systemic corticosteroids used, was it for more than 3 months? \r\n13. Fluorinated steroids used on face? ', 'Unknow'),
('EPICONDYLITIS', '0001-01-01 00:00:00', '1. Inquiry re duration? \r\n2. Inquiry re causes? \r\n3. Palpation, findings noted? \r\n4. Localized pain present? \r\n5. Tenderness on palpation of site present? \r\n6. Advice re avoidance of activity that caused or precipitated problem? ', 'Unknow'),
('EPILEPSY', '0001-01-01 00:00:00', '1. Type AND description of seizures? \r\n2. Frequency of seizures noted? \r\n3. Time of occurrence of seizures noted (eg. day, night, at work, at school, etc.)? \r\n4. Inquiry re precipitating factors on chart (3 minute)? \r\n5. Inquiry re family history of seizure disorder on chart (3 minute)? \r\n6. Neurological exam on chart (3 minute)? \r\n7. EEG on chart (3 minute)? \r\n8. IF neurological exam "abnormal", CAT scan on chart (3 minute) OR referral? \r\n9. Description of seizure by witness on chart (3 minute)? \r\n10. Names of drug(s) AND dosage? \r\n11. Discussion re dangerous activities (eg. driving car, working with machinery, etc.) on chart (3 minute)? \r\n12. Discussion re precipitating factors? \r\n13. IF seizures persist (more than one per week), referral? ', 'Unknow'),
('FAMILY PLANNING - FE', '0001-01-01 00:00:00', '1. Inquiry re 3 of following? \r\npregnancies \r\nabortions \r\nmenstrual history \r\ngynecological surgery \r\nhistory of PID \r\nsmoking history (# of cigarettes per day) \r\nthrombophlebitis \r\nheadaches (migraines) OR\r\nno risk factors statement? \r\n2. Blood pressure recorded? \r\n3. Pelvic exam? \r\n4. Pap smear within one year of starting birth control? \r\n5. IF on birth control pill or IUD, pap smear yearly? \r\n6. IF on birth control pill, OR justification statement? \r\n7. IF patient smokes more than 15 cigarettes per day OR is > 35 years old, oral contraceptives used? \r\n8. IF history of PID OR nulliparous, IUD used? \r\n9. IF smoker, advice re smoking? \r\n10. Breast self-examination (BSE) noted? \r\n11. Discussion of all methods of contraception on chart? ', 'Unknow'),
('FATIGUE, NYD (> 15 Y', '0001-01-01 00:00:00', '1. Inquiry re duration? \r\n2. Inquiry re relation to physical activity? \r\n3. Inquiry re presence/absence of diurnal variation? \r\n4. Inquiry re personal habits (alcohol, drugs)? \r\n5. Inquiry re stress factors? \r\n6. Inquiry re symptoms of depression (early morning wakening, feeling of worthlessness, weight loss, suicidal thoughts)? \r\n7. IF no positive findings in questions 4, 5 and/or 6 above, general assessment within 6 months? \r\n8. Hemoglobin? \r\n9. Urinalysis and micro? \r\n10. IF mention of abnormal thyroid, T4 OR TSH done? \r\n11. IF patient is on diuretics, electrolyte levels recorded? \r\n12. Drug treatment started before definitive diagnosis? \r\n13. One follow-up within 6 weeks? ', 'Unknow'),
('FEBRILE CONVULSION,', '0001-01-01 00:00:00', '1. Description of convulsion? \r\n2. Total time for convulsion noted? \r\n3. Inquiry re previous history of convulsions? \r\n4. Inquiry re fever in preceding 24 hours? \r\n5. Inquiry re illness in preceding 24 hours? \r\n6. Temperature recorded? \r\n7. Presence/absence of neck stiffness noted? \r\n8. ENT exam? \r\n9. Chest exam? \r\n10. Fever within previous 24 hours? \r\n11. IF temperature > 38 C (100.4 F), antipyretics OR instructions re sponging? \r\n12. IF bacterial cause of fever identified, antibiotics used? \r\n13. Discussion re fever therapy (fluids OR sponging OR antipyretics)? \r\n14. Follow-up within two weeks? \r\n15. IF convulsion lasts more than 20 minutes, admission OR immediate referral? \r\n16. Tetracycline used? ', 'Unknow'),
('FIBROCYSTIC DISEASE', '0001-01-01 00:00:00', '1. Inquiry re at least 2 of the following? \r\nbreast pain \r\nrelationship of lump to periods \r\nrecurrency of problem \r\nlocation of lump \r\n2. Description of both breasts? \r\n3. Statement of location and size of lumps? \r\n4. Axillary exam? \r\n5. IF lesion diagnosed as non-cystic, mammography? \r\n6. IF suspected cyst, aspiration OR referral? \r\n7. Yearly breast examination by physician following initial diagnosis? \r\n8. Cysts diagnosed by examination OR by mammography? \r\n9. BSE on chart every two years? \r\n10. IF discrete lump persists after aspiration, referral? ', 'Unknow'),
('FIBROMYOSITIS', '0001-01-01 00:00:00', '1. Inquiry re pain, description AND location?\r\n2. Inquiry re aggrravating AND/OR relieving factors?\r\n3. Inquiry re duration?\r\n4. Inquiry re sleep patterns?\r\n5. Inquiry re symptoms of fatigue AND/OR possible depression?\r\n6. Description of areas of pain?\r\n7. IF trigger point(s) noted, location(s)\r\n8. Hemoglobin AND sed rate within 6 months?\r\n9. Oral steroids used?\r\n10. Discussion re stress factors OR on chart (3 minute)?', 'Unknow'),
('FOLLICULITIS', '0001-01-01 00:00:00', '1. Inquiry re first or recurrent episode? \r\n2. Description of eruption? \r\n3. Location noted? \r\n4. IF recurrent (3 or more episodes in 1 year), C & S? \r\n5. IF recurrent (3 or more episodes in 1 year), serum glucose OR fasting blood sugar OR glucose tolerance test? \r\n6. IF oral antibiotics used, dosage AND duration recorded? \r\n7. IF folliculitis on face AND male > 16, advice re shaving? \r\n8. IF oral antibiotics used, one follow-up?', 'Unknow'),
('FOREIGN BODY IN NOSE', '0001-01-01 00:00:00', '1. Inquiry re how foreign body got into nose? \r\n2. Inquiry re which side is affected? \r\n3. IF removed, description of foreign body? \r\n4. IF foreign body not removed, referral to ENT specialist within 24 hours? ', 'Unknow'),
('FRACTURES', '0001-01-01 00:00:00', '1. Description of accident?\r\n2. Time since accident noted?\r\n3. Place of accident (eg. work related)?\r\n4. Description of fracture including presence/absence of deformity?\r\n5. Presence/absence of swelling?\r\n6. Comment re involvement of neurovascular structures?\r\n7. X-ray of fracture site?\r\n8. IF displaced, evidence of reduction OR referral?\r\n9. Immobilization?\r\n10. IF cast applied to extremity, follow-up within 48 hours?\r\n11. One follow-up?', 'Unknow'),
('GASTRITIS - HYPERACI', '0001-01-01 00:00:00', '1. Inquiry re location of abdominal pain? \r\n2. Inquiry re duration of abdominal pain? \r\n3. Inquiry re type of abdominal pain? \r\n4. Inquiry re aggravating causes (eg. food, smoking, alcohol, stress, drugs (ASA))? \r\n5. Inquiry re vomiting OR hematemesis? \r\n6. Abdominal exam? \r\n7. Advice re avoidance of aggravating factors (eg. smoking, spices, alcohol, etc.)? \r\n8. Discussion of stress factors? \r\n9. NSAIDs OR ASA OR cortisone used? ', 'Unknow'),
('GASTROENTERITIS AND', '0001-01-01 00:00:00', '1. Inquiry re presence/absence of vomiting? \r\n2. IF vomiting, frequency AND amount noted? \r\n3. Inquiry re frequency AND consistency AND mucus of stools? \r\n4. Inquiry re presence/absence of blood in stools? \r\n5. Inquiry re duration of symptoms? \r\n6. Inquiry re travel history? \r\n7. Abdominal exam? \r\n8. IF child \r\n9. Comment re presence/absence of dehydration? \r\n10. IF failure to respond in 2 days, CBC? \r\n11. IF failure to respond in 2 days, stool cultures? \r\n12. IF failure to respond in 2 days, electrolytes? \r\n13. IF failure to respond in 2 days, stool for occult blood? \r\n14. IF gastroenteritis, presence of diarrhea and vomiting recorded? \r\n15. Antispasmodics OR narcotic antidiarrheals OR antibiotics used? \r\n16. Discussion re avoidance of citrus juices and milk? ', 'Unknow'),
('GLAUCOMA', '0001-01-01 00:00:00', '1. Inquiry re vision at each visit? \r\n** NOTE **\r\nIF patient is followed by an ophthalmologist, Questions 2 through 8 are NOT APPLICABLE. \r\n2. Inquiry re compliance with medications? \r\n3. Fundi, yearly statement re optic cup? \r\n4. Visual fields recorded yearly? \r\n5. Intraocular pressure yearly? \r\n6. Medications, dosage recorded? \r\n7. High intraocular pressure ( >30 mm Hg ) recorded on chart (3 minute)? \r\n8. Follow-up yearly? \r\n9. IF ocular pressures are not improved after one month of treatment, referral? ', 'Unknow'),
('GLOMERULONEPHRITIS', '0001-01-01 00:00:00', '1. Inquiry re urination on each visit?\r\n2. Blood pressure?\r\n3. Weight?\r\n4. Urinalysis, routine AND micro yearly?\r\n5. Creatinine yearly?\r\n6. BUN yearly?\r\n7. Creatinine clearance yearly?\r\n8. Serum proteins yearly?\r\n9. Hemoglobin yearly?\r\n10. One of following?\r\nproteinemia reports on chart\r\ngranular casts\r\nrenal biopsy report on chart\r\n11. Follow-up at least yearly?', 'Unknow'),
('GONORRHEA', '0001-01-01 00:00:00', '1. Inquiry re time since exposure?\r\n2. Inquiry re sexual contacts?\r\n3. Inquiry re symptoms (discharge, dysuria)?\r\n4. Inquiry re sexual preferences and habits?\r\n5. Genital exam?\r\n6. IF oral sex noted, throat exam?\r\n7. IF anal sex noted, rectal exam?\r\n8. C & S, genital?\r\n9. IF indicated by history, C & S oral AND/OR rectal?\r\n10. Positive culture AND/OR gramstain?\r\n11. Antibiotics according to recommendations of Dept of Health (see list)?\r\n12. One follow-up with repeat cultures within 1 month?\r\n13. Counselling re prevention?\r\n14. Presence/absence of penicillin allergy noted on chart (3 minute)?\r\n15. Refer to Public Health Dept. OR insure follow-up of sexual contacts?\r\n16. VDRL in 6 weeks and 3 months?', 'Unknow'),
('GOUT', '0001-01-01 00:00:00', '1. Inquiry re at least one of following? \r\nsevere joint pain \r\nhistory of swelling \r\nhistory of inflammation \r\nmonoarticular joint \r\n2. List of drugs being used OR on chart (3 minute)? \r\n3. Presence/absence of swelling of involved joint? \r\n4. Presence/absence of inflammation of involved joint? \r\n5. IF joint aspiration done, report for uric acid crystals? \r\n6. Serum uric acid? \r\n7. One of the following? \r\nserum uric acid greater than lab normal \r\nuric acid crystals in joint aspirate \r\nX-ray diagnosis \r\n8. ASA used? \r\n9. NSAIDs OR Colchicine used? \r\n10. IF thiazides used, statement of justification? \r\n11. IF 3 or more episodes OR uric acid greater than lab normal, recommendation for prophylaxis treatment? \r\n12. Advice re avoidance of precipitating factors (eg. alcohol, high purine foods) \r\n13. IF flare-up occurs AND allopurinal OR uricosurics are being used, Colchicine used? ', 'Unknow'),
('HAY FEVER', '0001-01-01 00:00:00', '1. Inquiry re seasonal complaint?\r\n2. Inquiry re precipitating factors (e.g. ragweed, grass etc.)?\r\n3. One of following present; sneezing, rhinorrhea, nasal congestion?\r\n4. Examination of nose?\r\n5. Seasonal occurrence of nasal congestion?\r\n6. Discussion re air conditioning OR air filters?\r\n7. Discussion re avoidance of plants and pollen specific to patient?', 'Unknow'),
('HEAD INJURY', '0001-01-01 00:00:00', 'These questions apply only to the INITIAL\r\nPRESENTATION of a head injury.\r\n1. Description of injury?\r\n2. Level of consciousness since injury noted?\r\n3. Cause of injury noted?\r\n4. Mechanism of injury noted?\r\n5. Head and neck exam?\r\n6. ENT exam?\r\n7. Cranial nerves?\r\n8. Neurological exam?\r\n9. Pulse and blood pressure?\r\n10. Level of consciousness and orientation at time of exam?\r\n11. IF depressed consciousness, skull X-ray\r\nOR CAT scan OR referral?\r\n12. IF neck pain\r\nOR tenderness, cervical spine X-ray?\r\n13. Narcotics prescribed (including codeine)?\r\n14. IF sent home, instructions to family or friend re\r\nobservation for change in level of consciousness (i.e.\r\nhead injury sheet)?\r\n15. IF penetrating wound\r\nOR\r\ndeteriorating (i.e. change in sensorium), immediate referral?\r\n16. IF recurrent, discussion re safety measures (eg. helmets)?\r\n17. IF recurrent in child -abuse considered?', 'Unknow'),
('HEADACHE NYD', '0001-01-01 00:00:00', '1. Inquiry re at least 6 of the following? \r\nseverity \r\nfrequency \r\nlocation \r\nprecipitating factors \r\nmedication history \r\nduration \r\nassociated symptoms (eg. dizziness, blurred vision) \r\nprevious history of headaches \r\nhistory of head injury \r\nhistory of seizures \r\n2. Neurological exam? \r\n3. Blood pressure? \r\n4. One follow-up within 3 months OR referral? \r\n5. IF no definitive diagnosis within 3 months, referral? \r\n6. Inquiry re stress factors? ', 'Unknow'),
('HEMATOMA,', '0001-01-01 00:00:00', '1. Inquiry re history of trauma, type noted?\r\n2. Inquiry re spontaneous or traumatic?\r\n3. IF spontaneous, inquiry re previous episodes?\r\n4. IF spontaneous, inquiry re family history of bleeding?\r\n5. Description of size?\r\n6. Description of location?\r\n7. IF spontaneous, CBC, platelets, PT, PTT done?\r\n8. IF seen within 48 hours of onset, ice recommended?\r\n9. IF spontaneous OR recurrent, one follow-up?\r\n10. IF child (other recent or old trauma)?\r\n11. IF AND history of repeated trauma (3 or more within 2 years) skeletal survey?', 'Unknow'),
('HEMATOMA,SUBCUTANEOU', '0001-01-01 00:00:00', '1. Inquiry re history of trauma, type noted? \r\n2. Inquiry re spontaneous or traumatic? \r\n3. IF spontaneous, inquiry re previous episodes? \r\n4. IF spontaneous, inquiry re family history of bleeding? \r\n5. Description of size? \r\n6. Description of location? \r\n7. IF spontaneous, CBC, platelets, PT, PTT done? \r\n8. IF seen within 48 hours of onset, ice recommended? \r\n9. IF spontaneous OR recurrent, one follow-up? \r\n10. IF child (other recent or old trauma)? \r\n11. IF AND history of repeated trauma (3 or more within 2 years) skeletal survey? ', 'Unknow'),
('HEMATURIA', '0001-01-01 00:00:00', '1. Inquiry re first or recurrent episode?\r\n2. Inquiry re frequency of hematuria?\r\n3. Presence/absence of flank pain noted?\r\n4. Presence/absence of dysuria OR frequency noted?\r\n5. Microscopic or gross hematuria noted?\r\n6. Presence/absence of colicky pain noted?\r\n7. Abdominal exam?\r\n8. Flank percussion, findings noted?\r\n9. IF male, rectal AND genital exam?\r\n10. IF female AND 2nd or more episode within 1 year, pelvic exam?\r\n11. Urinalysis AND micro?\r\n12. Urine C & S?\r\n13. BUN AND/OR Creatinine?\r\n14. IF 2nd episode within 2 years, IVP OR referral?\r\n15. IF > 60 years AND source not identified, referral?', 'Unknow'),
('HEMORRHOIDS', '0001-01-01 00:00:00', '1. Inquiry re pain?\r\n2. Inquiry re bleeding?\r\n3. Rectal exam?\r\n4. IF rectal bleeding, sigmoidoscopic exam on chart (3 minute)?\r\n5. IF patient >40 and no definitive diagnosis for rectal bleeding found on sigmoidoscopic, barium enema?\r\n6. Description of site and location of hemorrhoids?\r\n7. One or more of the following used? dietary (high fibre, avoid constipation) suppositories sitz baths surgical ligation and banding I & D if acute thrombosed hemorrhoids\r\n8. IF symptoms unchanged for more than 3 months, referral?\r\n9. Discussion re high fibre diet and stool softeners?\r\n10. One follow-up within one month?', 'Unknow'),
('HERPANGINA', '0001-01-01 00:00:00', '1. Inquiry re duration of sore throat? \r\n2. Examination of throat? \r\n3. Antibiotics used?', 'Unknow'),
('HERPES ZOSTER', '0001-01-01 00:00:00', '1. Description of lesions? \r\n2. Location of lesions noted? \r\n3. IF lesions on forehead OR physician notes "ophthalmic distribution", examination of cornea OR referral? ', 'Unknow'),
('HERPETIC ULCER (EYE)', '0001-01-01 00:00:00', '1. Inquiry re pain in eye?\r\n2. Red eye noted?\r\n3. Dendrite shaped ulceration noted?\r\n4. Fluorescein staining positive?\r\n5. Referral to ophthalmologist?\r\n6. Steroids used locally?', 'Unknow'),
('HERPETIC ULCER, VULV', '0001-01-01 00:00:00', '1. Inquiry re history of vaginal complaint? \r\n2. Description of lesion? \r\n3. Location of lesion? \r\n4. Viral culture (scraping)? \r\n5. IF initial culture negative AND patient pregnant OR lesion persists, repeat culture? \r\n6. Positive viral culture? \r\n7. IF present at labour, Caesarian section OR referral? ', 'Unknow'),
('HYPERLIPIDEMIA', '0001-01-01 00:00:00', '1. Family history OR on chart (3 minute)? \r\n2. Cardiovascular exam? \r\n3. Weight recorded? \r\n4. Abdominal exam? \r\n5. Comment re xanthomas? \r\n6. Blood sugar OR glucose tolerance test? \r\n7. Lipids? \r\n8. Lipid level above lab normal? \r\n9. Discussion re diet? \r\n10. IF obesity noted, discussion re weight reduction? \r\n11. Discussion re alcohol AND/OR exercise? ', 'Unknow'),
('HYPERTENSION (ANY AG', '0001-01-01 00:00:00', '1. Inquiry re family history of stroke, M.I. OR on chart (3 minute)? \r\n2. Medications taken listed at least twice in 2 year period? \r\n3. One blood pressure per visit (at least 75%)? \r\n4. Yearly comment on heart AND lungs AND fundi AND weight?\r\n5. ECG, on chart (3 minute)? \r\n6. Urinalysis, on chart (3 minute)? \r\n7. IF smoker, advice re smoking? \r\n8. IF obesity noted, advice re weight loss? \r\n9. IF on medication, at least 2 visits per year? \r\n10. IF patient AND diastolic B.P. > 105 on three consecutive visits, referral? \r\n11. Inquiry re stress factors at least once? \r\n12. Inquiry re alcohol intake at least once? \r\n13. IF oral contraceptives used, was justification noted? \r\n14. IF sympathomimetics used, was justification noted?\r\n15. IF diastolic B.P. > 105 on two consecutive occasions, treated with medication? ', 'Unknow'),
('HYPERTENSION, < 75 Y', '0001-01-01 00:00:00', '1. Inquiry re family history of stroke AND/OR M.I., OR on chart (3 minute)? \r\n2. Right and left arm blood pressure at least once on chart? \r\n3. One blood pressure per visit (at least 75%)? \r\n4. Yearly comment on heart AND lungs AND fundi AND weight? \r\n5. ECG, on chart (3 minute)? \r\n6. Urinalysis, on chart (3 minute)? \r\n7. Were there at least two readings with diastolic greater than 90 OR one reading greater than 105 before drug therapy was started? \r\n8. IF diastolic B.P. > 105 or systolic > 200, first line antihypertensive used (thiazides AND/OR beta blockers)? \r\n9. IF second line antihypertensive were used, were first line antihypertensives tried for at least 3 months? \r\n10. IF smoker, advice re smoking? \r\n11. IF obesity noted, advice re weight loss (eg. diet or exercise)? \r\n12. IF patient on drugs, at least 2 visits per year? \r\n13. IF patient has persistant B.P. > 105, referral after 6 months? \r\n14. Inquiry re stress factors? \r\n15. IF oral contraceptives used, justification noted? \r\n16. IF sympathomimetics used, justification noted? ', 'Unknow'),
('HYPERTHYROIDISM, NEW', '0001-01-01 00:00:00', '1. Inquiry re one or more of following?\r\nweight loss palpitations\r\ntremulousness restlessness\r\nmuscular weakness\r\nfatigue\r\n2. Thyroid exam?\r\n3. Pulse?\r\n4. Examination of eyes?\r\n5. T4 OR T3 OR resin uptake OR other thyroid tests?\r\n6. T4 AND T3 AND uptake elevated?\r\n7. Follow-up every 6 months?\r\n8. Euthyroid within 6 months OR referral?', 'Unknow');
INSERT INTO `encountertemplate` (`encountertemplate_name`, `createdatetime`, `encountertemplate_value`, `creator`) VALUES
('HYPERTHYROIDISM, TRE', '0001-01-01 00:00:00', '1. Inquiry re at least one of the following at each visit? \r\nenergy \r\nweight \r\nheat sensitivity \r\n2. If new patient to practice within past 2 years, inquiry re duration of disease? \r\n3. If new patient to practice within past 2 years, examination of thyroid and eyes noted? \r\n4. Heart rate OR pulse at each visit? \r\n5. T3 RIA OR TSH yearly? \r\n6. At least one abnormal thyroid test on chart (3 minute), TSH down OR T4 up? \r\n7. Follow-up yearly? ', 'Unknow'),
('HYPOTHROIDISM', '0001-01-01 00:00:00', '1. Inquiry re previous thyroid treatment? \r\n2. Inquiry re at least one of following? \r\nsensitivity to cold chronic fatigue \r\nmental dullness menses\r\ngeneralized weakness constipation\r\n3. Thyroid exam? \r\n4. Reflex exam? \r\n5. Comment re at least one of the following? \r\ndry skin voice change\r\nmyxedema lethargy\r\n6. T4 done? \r\n7. T4 repeat, every second dosage change? \r\n8. One of; low T4, low T3, or low uptake, or high TSH? \r\n9. IF newly diagnosed (within last two years), extracts used? \r\n10. IF lab test normal? \r\n11. IF >= 60, follow-up every 2 weeks until euthyroid or lab tests normal? \r\n12. Euthyroid within 6 months OR referral? ', 'Unknow'),
('IMPETIGO or PYODERMA', '0001-01-01 00:00:00', '1. Site noted?\r\n2. IF oral antibiotic used, was it one of penicillins, erythromycins, sulfonamides, tetracyclines, or cephalosporins?\r\n3. IF tetracycline used, was patient', 'Unknow'),
('IMPOTENCE', '0001-01-01 00:00:00', '1. Inquiry re impotence, constant or intermittant?\r\n2. Inquiry re alcohol use?\r\n3. Inquiry re D.M., or systemic disease?\r\n4. Inquiry re emotional problems?\r\n5. Inquiry re nocturnal erections?\r\n6. Inquiry re medications?\r\n7. Genital exam?\r\n8. Blood pressure?\r\n9. Abdominal exam?\r\n10. Neurological exam?\r\n11. Exam of pulses?\r\n12. Urinalysis?\r\n13. Fasting blood sugar?\r\n14. One follow-up?\r\n15. IF problem persists for > 3 months, referral?\r\n16. Sexual counselling with partner?', 'Unknow'),
('INFANTILE COLIC', '0001-01-01 00:00:00', '1. Inquiry re at least two of following? \r\nvomiting\r\nbowel movements\r\nburping\r\npassing gas\r\nfluid intake\r\n2. Inquiry re timing of crying? \r\n3. Weight recorded with initial diagnosis? \r\n4. Comment on appearance of baby? \r\n5. Evidence of evening crying after feeding? \r\n6. At least one follow-up with comment on colic status? \r\n7. Evidence of some support for parent(s) by one of following?\r\npublic health nurse\r\nreassurance and/or discussion by family doctor\r\ninvolvement of family members', 'Unknow'),
('INFECTIOUS NOMONUCLE', '0001-01-01 00:00:00', '1. Inquiry re at least two of following?\r\nsore throat\r\nfever\r\nmalaise\r\nlymphadenopathy\r\nabdominal pain\r\n2. Presence/absence of fever noted?\r\n3. Throat exam?\r\n4. Presence/absence of lymphadenopathy noted?\r\n5. Presence/absence of hepatosplenomegaly noted?\r\n6. WBC AND diff.?\r\n7. Mono screen?\r\n8. Positive mono test OR abnormal WBC''s?\r\n9. Advice re reduced activity?\r\n10. Ampicillin used?\r\n11. IF splenomegaly present, follow-up within 2 weeks?\r\n12. IF splenomegaly not present, follow-up within 4 weeks?\r\n13. IF splenomegaly present, advice re avoidance of contact sports or activities?', 'Unknow'),
('INFERTILITY, FEMALE', '0001-01-01 00:00:00', '1. Parity noted?\r\n2. Infertility for more than 2 years?\r\n3. Inquiry re medication history?\r\n4. Inquiry re menstrual history?\r\n5. Pelvic exam?\r\n6. Examination of breasts?\r\n7. CPE within 2 years after initial diagnosis?\r\n8. Pap smear AND/OR referral?\r\n9. Semen analysis (sexual partner/husband) \r\nOR referral?\r\n10. BS within 6 months after initial diagnosis OR referral?\r\n11. T3 AND/OR T4 within 6 months after initial diagnosis OR referral?\r\n12. Plan of action noted OR referral?', 'Unknow'),
('INFLUENZA', '0001-01-01 00:00:00', '1. Inquiry re three of the following?\r\nmyalgia\r\nfever\r\ncough\r\nphlegm type\r\nmalaise\r\n2. Inquiry re duration of symptoms?\r\n3. ENT exam?\r\n4. IF coughing, chest exam?\r\n5. IF antibiotics prescribed, was there history of secondary infection (coloured phlegm, or fever > 38 for 3 days or more)\r\nOR\r\nhigh risk (cardiac valvular disease or chronic pulmonary disease)?', 'Unknow'),
('INGUINAL HERNIA', '0001-01-01 00:00:00', '1. Inquiry re presence/absence of vomiting?\r\n2. Inquiry re at least two of following?\r\ninguinal bulge\r\nduration\r\npain\r\n3. Description of inguinal mass including side?\r\n4. Reducible or not noted?\r\n5. IF not reducible AND painful, referral to surgeon within 24 hours?', 'Unknow'),
('INTERMITTENT CLAUDIC', '0001-01-01 00:00:00', '1. Inquiry re duration of pain? \r\n2. Inquiry re current smoking status? \r\n3. Presence/absence of pulses in legs? \r\n4. Blood pressure? \r\n5. Comment on abdomen OR aneurysm? \r\n6. Comment on legs, warmth OR hair growth OR colour? \r\n7. CPE within 12 months before OR 6 months after presentation?\r\n8. Cholesterol OR triglycerides? \r\n9. Blood sugar? \r\n10. Pain in legs with exercise or walking, relieved by rest? \r\n11. IF smoker, advice re smoking? \r\n12. Discussion re foot care? ', 'Unknow'),
('IRITIS', '0001-01-01 00:00:00', '1. Inquiry re at least one of following; blurred vision, painful eye, red eye, photophobia? \r\n2. Description of eye? \r\n3. Referral OR phone consultation? ', 'Unknow'),
('IRON DEFICIENCY ANEM', '0001-01-01 00:00:00', '** NOTE **\r\nNon-pregnant, new presentation \r\n1. Inquiry re bleeding from bowel? \r\n2. Inquiry re bleeding from other sources (eg. nose, vagina) \r\n3. Inquiry re diet? \r\n4. Hemoglobin OR hematocrit? \r\n5. Indices MCV AND MCHC OR smear? \r\n6. Two of following? \r\nSerum ferritin \r\nserum iron \r\ntotal iron binding capacity \r\n7. Stool for occult blood? \r\n8. Serum ferritin OR hemoglobin microcytic smear OR low indices (MCV and MCHC)? \r\n9. Oral iron prescribed? \r\n10. IF poor diet noted, diet counselling? \r\n11. One follow-up within 6 weeks? \r\n12. IF injectable iron used, justification statement?', 'Unknow'),
('IRRITABLE BOWEL', '0001-01-01 00:00:00', '1. Inquiry re bowel activity OR cramps, once per 6 months? \r\n2. Abdominal exam once per year? \r\n3. Stool for occult blood once per year? \r\n4. Sigmoidoscopic exam OR on chart (3 minute)? \r\n5. UGI series with small bowel follow through OR on chart (3 minute)? \r\n6. Presence of constipation OR diarrhea OR cramps? \r\n7. Barium enema OR on chart (3 minute)? \r\n8. Follow-up at least once within 6 months? \r\n9. Discussion of stress factors? \r\n10. Narcotics used? ', 'Unknow'),
('KERATITIS, INFLAMMAT', '0001-01-01 00:00:00', '1. Inquiry re at least one of following? \r\nphotophobia \r\npain in eye \r\nocular discharge \r\ntearing of eye \r\n2. Duration of symptoms? \r\n3. Description of cornea? \r\n4. Fluoroscein staining? \r\n5. Corticosteroid eye drops used? \r\n6. Follow-up within 48 hours? \r\n7. IF not improved within 48 hours, referral? ', 'Unknow'),
('KIDNEY OBSTRUCTION', '0001-01-01 00:00:00', '1. Inquiry re pain? \r\n2. Abdominal exam? \r\n3. Blood pressure? \r\n4. BUN OR creatinine? \r\n5. Urinalysis AND C & S? \r\n6. IVP shows blockage? \r\n7. Referral within 1 week?', 'Unknow'),
('KNEE INJURIES', '0001-01-01 00:00:00', '1. Description of how injury happened?\r\n2. Duration of discomfort?\r\n3. Presence/absence of locking or collapse?\r\n4. Presence/absence of swelling?\r\n5. Comment on function?\r\n6. Comment on stability of ligaments?\r\n7. IF effusion persists for more than 72 hours, joint aspiration OR referral?\r\n8. IF locking OR instability, referral?', 'Unknow'),
('LACERATIONS', '0001-01-01 00:00:00', '1. Inquiry re how laceration occurred?\r\n2. Time between injury and visit?\r\n3. Description of wound?\r\n4. IF hand or wrist, comment on function?\r\n5. IF tendons severed, referral?\r\n6. Debridement (washing)?\r\n7. IF sutured, one follow-up?\r\n8. IF no tetanus toxoid within 10 years, injection given?', 'Unknow'),
('LACERATIONS OF SKIN', '0001-01-01 00:00:00', '** NOTE **\r\nFOR QUESTIONS 1 THROUGH 7, PHYSICIAN MUST FULFILL CONDITION FOR EACH EPISODE OF LACERATION. \r\n1. Inquiry re how laceration occurred? \r\n2. Time between injury and visit? \r\n3. Description of wound? \r\n4. IF hand or wrist, comment on function? \r\n5. IF tendons severed, referral? \r\n6. Debridement (washing)? \r\n7. IF sutured, one follow-up? \r\n8. IF no tetanus toxoid within 10 years, injection given? ', 'Unknow'),
('LARYNGITIS', '0001-01-01 00:00:00', '1. Inquiry re duration?\r\n2. Inquiry re smoking (or on chart) (3 minute)?\r\n3. Inquiry re specific cause (eg. shouting, occupation)?\r\n4. Exam of pharynx?\r\n5. IF persistant for more than 6 weeks, laryngoscopic exam OR referral?\r\n6. IF smoker, advice re smoking?', 'Unknow'),
('LARYNGITIS OR TRACHE', '0001-01-01 00:00:00', '1. Duration of symptoms?\r\n2. Presence/absence of cough noted?\r\n3. Throat exam?\r\n4. Chest exam?', 'Unknow'),
('LICE AND SCABIES', '0001-01-01 00:00:00', '1. Inquiry re itching or pruritis?\r\n2. Location noted?\r\n3. IF scabies, description of skin lesion(s)?\r\n4. Gamma Benzene Hexachloride Lotion OR Shampoo?\r\n5. IF used?\r\n6. Instructions re washing clothing and bed linen?\r\n7. IF scabies, entire family treated?', 'Unknow'),
('LOBAR PNEUMONIA', '0001-01-01 00:00:00', '1. Inquiry re at least one of following? \r\ncough \r\ndyspnea \r\nchest pain \r\nfever \r\n2. Description of breath sounds? \r\n3. Comment re dullness OR consolidation? \r\n4. Sputum C & S? \r\n5. WBC? \r\n6. Chest X-ray, 2 views? \r\n7. IF X-ray positive, follow-up X-ray within 30 days? \r\n8. Positive culture AND positive X-ray OR consolidation on examination? \r\n9. Oral penicillin or erythromycin or cephalosporin given? \r\n10. Dosage recorded? \r\n11. Amount recorded? \r\n12. Follow-up in 1 week? ', 'Unknow'),
('LOW BACK PAIN, NOS,', '0001-01-01 00:00:00', '1. Inquiry re duration AND location of pain? \r\n2. Inquiry re presence/absence of one of following? \r\nparesthesia \r\nsensory aberrations \r\nradiation of pain \r\n3. Inquiry re presence/absence of trauma? \r\n4. Inquiry re previous episode(s)? \r\n5. Movement of back (flexion OR extension OR lateral flexion OR rotation) noted? \r\n6. Note on reflexes (one of knee OR ankle)? \r\n7. Note on straight leg raising? \r\n8. IF pain persists for more than 1 month, lumbar spine AP AND lateral X-rays? \r\n9. IF narcotic analgesic (except codeine compounds, 30 mg. codeine max.) used, justification statement? \r\n10. Back exercises AND/OR back care instructions? \r\n11. One follow-up? \r\n12. IF still continuously painful after 3 months, consultation OR referral? ', 'Unknow'),
('LYMPHADENOPATHY NYD', '0001-01-01 00:00:00', '1. Inquiry re location of enlarged glands? \r\n2. Inquiry re duration? \r\n3. Description of node(s)? \r\n4. IF in axilla OR groin, comment on extremity? \r\n5. IF in neck, ear and throat exam? \r\n6. IF non-neck node AND no obvious cause noted, CBC?\r\n7. IF neck node AND no obvious cause noted, infectious monocucleosis screen (Monospot)? \r\n8. IF lesion persists for one month or more at the same size, chest X-ray? \r\n9. IF lesion persists for two months or longer, biopsy of node OR referral? \r\n10. Antibiotic used AND it was one of the penicillins, erythromycins, sulfonamides, cephalosporins, OR tetracyclines? \r\n11. IF the patient was\r\n12. IF no infectious cause noted, one follow-up? ', 'Unknow'),
('MENOPAUSAL SYNDROME', '0001-01-01 00:00:00', '1. Inquiry re menstrual history (all of: cycle, flow, LMP)? \r\n2. Inquiry re hot flashes/flushes? \r\n3. CPE within one year after initial diagnosis? \r\n4. Pap smear within one year after initial diagnosis? \r\n5. IF Premarin OR conjugated estrogens used, cyclical use OR progestational agent added (5 days per 3 months)? \r\n6. Discussion re post-menopausal sexual problems (i.e. lack of lubrication) on chart (3 minute)? ', 'Unknow'),
('MENORRHAGIA', '0001-01-01 00:00:00', '1. Inquiry re bleeding pattern, duration AND amount?\r\n2. IF\r\n3. Pelvic exam on initial visit OR when bleeding stops?\r\n4. Hb?\r\n5. Pap smear on initial visit OR when bleeding stops?\r\n6. Cause established OR referral within 3 months of initial visit for problem?', 'Unknow'),
('MIGRAINE EQUIVALENTS', '0001-01-01 00:00:00', '1. Inquiry re presence/absence of aura? \r\n2. IF aura present, inquiry re type of aura? \r\n3. Inquiry re location of pain? \r\n4. Inquiry re change in headaches?\r\n5. Neurological exam within last year? \r\n6. Blood pressure within last year? \r\n7. IF medication prescribed, dosage noted? \r\n8. IF medication prescribed, duration noted?', 'Unknow'),
('MONOARTICULAR ARTHRI', '0001-01-01 00:00:00', '** NOTE **\r\nOne large joint; ankle, knee, hip, wrist, elbow, shoulder. \r\n1. Inquiry re pain? \r\n2. Site noted? \r\n3. Inquiry re duration of symptoms? \r\n4. Inquiry re presence/absence of trauma? \r\n5. Description of joint? \r\n6. Temperature recorded OR history of fever? \r\n7. One large severely painful joint with abnormalities upon examination? \r\n8. Definitive diagnosis on chart within 3 days OR referral? ', 'Unknow'),
('MOUTH LESION', '0001-01-01 00:00:00', '1. Inquiry re location? \r\n2. Inquiry re duration? [HA2 ]> \r\n3. Description of lesion? \r\n4. IF lesion described as "ulcer" or "plaque" AND lesion not healed in 2 months, investigation OR referral? ', 'Unknow'),
('MUMPS', '0001-01-01 00:00:00', '1. Inquiry re duration of symptoms? \r\n2. Swelling in parotid area noted? \r\n3. IF male > 11 years, testicular exam? \r\n4. IF analgesic used, was it ASA or acetaminophen? ', 'Unknow'),
('MYOCARDIAL INFARCTIO', '0001-01-01 00:00:00', '** NOTE **\r\nQUESTIONS 1 THROUGH 6 SHOULD BE PRESENT ON AT LEAST 75% OF VISITS. \r\n1. Inquiry re chest pain relating to activity? \r\n2. Inquiry re palpitations? \r\n3. Inquiry re dyspnea? \r\n4. Blood pressure? \r\n5. Chest auscultation? \r\n6. Cardiac auscultation (sounds AND rhythm AND murmurs)? \r\n7. Lipids (cholesterol AND triglycerides) within one year of hospital discharge? \r\n8. IF new abnormal rhythm noted, ECG within 2 days? \r\n9. Current medications recorded (name AND dosage)? \r\n10. Inquiry re risk factors (eg. diet, blood pressure, smoking, obesity)? \r\n11. One follow-up by family doctor or specialist within 4 weeks of discharge? \r\n12. Following initial visit after discharge, follow-up at least every 3 months for one year? ', 'Unknow'),
('NASAL INJURY', '0001-01-01 00:00:00', '1. Description of accident? \r\n2. Description of nose including 2 of following; swelling, amount of bleeding, deformity, lacerations? \r\n3. IF deformity found on examination, X-ray of nasal bones? \r\n4. IF deformity found on examination, referral to ENT specialist? \r\n5. IF unable to control bleeding, referral? ', 'Unknow'),
('NASAL POLYP', '0001-01-01 00:00:00', '1. Inquiry re nasal symptoms? \r\n2. Inquiry re history of asthma or ASA allergy (or on chart) (3 minute)? \r\n3. Description of polyp? \r\n4. IF no improvement after 6 weeks, referral? ', 'Unknow'),
('NASOPHARYNGITIS OR U', '0001-01-01 00:00:00', '1. Complaint of at least one of the following? \r\nnasal discharge\r\nsore throat\r\nmalaise \r\ncold \r\n2. Duration of symptoms noted? \r\n3. IF cough in history, chest exam?\r\n4. IF patient \r\n5. IF sore throat in history, throat exam?\r\n6. IF narcotic antitussives prescribed, cough in history? \r\n7. IF antibiotics prescribed, was there history of secondary infection (coloured phlegm, or fever > 38 for 3 days or more)OR\r\nhigh risk (cardiac valvular disease or chronic pulmonary disease)? ', 'Unknow'),
('NASOPHARYNGITIS, CHR', '0001-01-01 00:00:00', '1. History of one of following? \r\nnasal spray \r\nnasal stuffiness \r\npost-nasal drip \r\ncigarette smoking \r\nexposure to dust or fumes \r\n2. Description of nasal mucosa? \r\n3. Advice re irritants (stop smoking, avoid dust and fumes)? ', 'Unknow'),
('NOCTURNAL ENURESIS', '0001-01-01 00:00:00', '** NOTE**\r\nAudit only for patients at least 4 years old. \r\n1. Inquiry re family history of enuresis? \r\n2. Inquiry re frequency of bedwetting? \r\n3. Inquiry re remissions and exacerbations? \r\n4. Genital exam, once on chart (3 minute)? \r\n5. Urinalysis, once on chart (3 minute)? \r\n6. Urine C & S, once on chart (3 minute)? \r\n7. IF urine culture positive, IVP OR ultrasound? \r\n8. IF recurrent positive urine culture, voiding cystogram OR referral? \r\n9. History of bedwetting on chart? \r\n10. Follow-up at least once? \r\n11. Family counselling, parents and child? \r\n12. Management plan on chart involving at least one of following? \r\nmedications \r\ncounselling \r\ndry-night record ', 'Unknow'),
('NOSEBLEED, ANTERIOR', '0001-01-01 00:00:00', '1. Inquiry re frequency? \r\n2. Inquiry re duration? \r\n3. Some estimate of blood loss noted? \r\n4. Examination of nose? \r\n5. IF active bleeding at time of visit, blood pressure recorded? \r\n6. IF > 60 years, hemoglobin? \r\n7. IF recurrent nose bleeder (2 episodes within 6 months), CBC AND platelet count AND PT AND PTT on chart? \r\n8. One of the following? \r\ngross bleeding \r\nphysical evidence of bleeding vessel on examination \r\n9. IF packing performed, follow-up within 2 days? \r\n10. IF Hg \r\n11. IF 3 nosebleeds within past 2 days AND not actively bleeding, cautery OR prescription of ointment? \r\n12. IF acute nosebleed, packing AND/OR cautery AND/OR referral? ', 'Unknow'),
('OBESITY', '0001-01-01 00:00:00', '1. Inquiry re duration of obesity? \r\n2. Weight recorded? \r\n3. Height recorded? \r\n4. Height AND weight recorded? \r\n5. Anorexiants OR thyroid drugs (if hypothyroidism not diagnosed) OR diuretics used? \r\n6. Diet counselling OR nutritional counselling (physician or dietician)? \r\n7. IF treatment given, follow-up within 6 weeks? ', 'Unknow'),
('ORCHITIS AND EPIDIDY', '0001-01-01 00:00:00', '1. Inquiry re location of pain?\r\n2. Inquiry re swelling of testes?\r\n3. Examination of testicles?\r\n4. Comment re tenderness?\r\n5. WBC?\r\n6. Urinalysis?\r\n7. Urine C & S?\r\n8. Support to scrotum?\r\n9. IF epididymitis, antibiotics used?\r\n10. IF antibiotics used, amount AND duration noted?\r\n11. Follow-up within one week?', 'Unknow'),
('OSTEOPOROSIS', '0001-01-01 00:00:00', '\r\n1. Inquiry re presence/absence of pain?\r\n2. Inquiry re dietary history?\r\n3. Inquiry re menopause date?\r\n4. IF pain present, examination of area?\r\n5. Comment re kyphosis?\r\n6. X-ray OR bone density OR cortical thickness?\r\n7. Confirmation of osteoporosis by any of tests in question 6?\r\n8. Increased calcium intake (supplements or dietary)?', 'Unknow'),
('OTITIS EXTERNA', '0001-01-01 00:00:00', '1. Inquiry re symptoms?\r\n2. Ear exam?\r\n3. Evidence of "normal drum"?', 'Unknow'),
('OTITIS MEDIA -SEROUS', '0001-01-01 00:00:00', '1. Inquiry re at least two of following; hearing, pain, recurrent URI?\r\n2. Comment re fluid in middle ear OR retracted ear drum?\r\n3. Comment re nose AND throat?\r\n4. IF third episode or more, audiometry OR referral?\r\n5. IF physical findings OR hearing test are abnormal, follow-up until resolved OR referral?', 'Unknow'),
('OTITIS MEDIA ACUTE', '0001-01-01 00:00:00', '1. Description of symptoms? \r\n2. Duration of symptoms? \r\n3. Examination of ears? \r\n4. Comment re one of the following? \r\nred drum \r\nbulging drum \r\nloss of light reflex \r\n5. IF tetracycline or chloramphenicol used, was patient\r\n6. Antibiotics prescribed for at least 10 days? \r\n7. IF > 4 years AND antibiotic used, was it ampicillin, penicillin or erythromycin? \r\n8. IF AND antibiotic used, was it penicillin, amoxicillin, sulfa or erythromycin? \r\n9. One follow-up within 4 weeks of episode with statement of patient''s condition? ', 'Unknow'),
('PARAPHIMOSIS', '0001-01-01 00:00:00', '1. Inquiry re pain? \r\n2. Foreskin not reducible by patient? \r\n3. Description of penis? \r\n4. Reduction attempted by physician? \r\n5. Counselling on care of penis? \r\n6. IF physician unable to reduce, follow-up or referral? ', 'Unknow'),
('PELVIC INFLAMMATORY', '0001-01-01 00:00:00', '1. Inquiry re pelvic pain AND vaginal discharge? \r\n2. Inquiry re previous PID OR venereal disease? \r\n3. Inquiry re menstrual history? \r\n4. Pelvic exam with comment re cervical discharge? \r\n5. Comment re adnexal examination? \r\n6. Comment re pelvic tenderness (cervical excitation)? \r\n7. Presence/absence of fever noted? \r\n8. WBC? \r\n9. Urinalysis? \r\n10. Micro? \r\n11. VDRL? \r\n12. Cervical/vaginal C & S? \r\n13. IF bleeding, pregnancy test? \r\n14. Antibiotic used? \r\n15. Follow-up within 10 days? ', 'Unknow'),
('PEPTIC ULCER', '0001-01-01 00:00:00', '1. Inquiry re epigastric pain?\r\n2. Inquiry re past history of similar symptoms?\r\n3. Inquiry re relief from antacid or milk?\r\n4. Abdominal exam?\r\n5. UGI series\r\nOR\r\ngastroscopy done?\r\n6. UGI series\r\nOR\r\ngastroscopy demonstrates ulcer crater\r\nAND/OR scarring?\r\n7. IF GASTRIC ulcer demonstrated by UGI series\r\nOR\r\ngastroscopy, procedure repeated within 6 weeks?\r\n8. Instruction re diet?\r\n9. IF smoker, advice re smoking?\r\n10. Instruction re alcohol?\r\n11. Counselling re stress factors?\r\n12. Were any of the following drugs used?\r\noral steroids\r\nnonsteroidal anti-inflammatories\r\nASA\r\ncolchicine\r\n13. Follow-up at least every 6 weeks until asymptomatic\r\nOR\r\nhealing demonstrated by UGI series\r\nOR\r\ngastroscopy?', 'Unknow'),
('PERFORATION TYMPANIC', '0001-01-01 00:00:00', '1. Inquiry re cause? \r\n2. Inquiry re pain? \r\n3. Inquiry re discharge? \r\n4. Location of perforation? \r\n5. Size of perforation? \r\n6. Follow-up until resolved or referral? ', 'Unknow'),
('PERITONISILLAR ABSCE', '0001-01-01 00:00:00', '1. Inquiry re sore throat? \r\n2. Inquiry re swallowing difficulties? \r\n3. Throat exam? \r\n4. Description of mass? \r\n5. Referral or hospitalization? ', 'Unknow'),
('PHARYNGITIS', '0001-01-01 00:00:00', '1. Inquiry re sore throat? \r\n2. Inquiry re duration? \r\n3. Examination of pharynx? \r\n4. IF white membrane OR lot of exudate noted, mono test AND C & S? \r\n5. Red (inflamed, injected) throat? \r\n6. IF AND positive strep culture, amoxil or ampicillin or erythromycin given for at least 7 days? \r\n7. IF 5 years or older AND positive strep culture, penicillin or erythromycin for at least 7 days? ', 'Unknow'),
('PINWORMS', '0001-01-01 00:00:00', '1. Inquiry re pruritis of anus or vulva? \r\n2. Examination for eggs AND/OR worms on anus? \r\n3. Pinworm test? \r\n4. Pyrvinium pamovate OR Vanquin used? \r\n5. Whole household treated simultaneously? \r\n6. Positive eggs OR positive worms OR positive pinworm test? ', 'Unknow'),
('PITYRIASIS ROSEA', '0001-01-01 00:00:00', '1. Inquiry re duration of rash? \r\n2. Inquiry re herald patch? \r\n3. Description of distribution? \r\n4. VDRL? \r\n5. Oral steroids used? \r\n6. Counselling re duration? ', 'Unknow'),
('PLEURISY', '0001-01-01 00:00:00', '1. Inquiry re duration of symptoms? \r\n2. Inquiry re location of pain? \r\n3. Presence/absence of fever noted? \r\n4. Presence/absence of cough noted? \r\n5. Inquiry whether chest pain worse with deep breathing (pleuritic)? \r\n6. Chest exam? \r\n7. Throat exam? \r\n8. CVS exam? \r\n9. Blood pressure? \r\n10. Temperature recorded? \r\n11. IF temperature elevated OR sputum, CBC? \r\n12. IF sputum, C & S? \r\n13. IF rales AND/OR rhonchi present, chest X-ray? \r\n14. IF antibiotics prescribed, C & S of sputum done before use of antibiotic? \r\n15. IF smoker, advice re smoking? \r\n16. Cause stated OR referral? ', 'Unknow'),
('PREGNANCY, DELIVERY,', '0001-01-01 00:00:00', '1. Ontario antenatal records I AND II? \r\n2. Urinalysis with each visit? \r\n3. Hemoglobin each trimester? \r\n4. IF urinalysis positive for glucose on 2 occasions, blood sugar OR glucose tolerance test OR referral? \r\n5. IF dipstick urinalysis positive, lab report of urinalysis and micro? \r\n6. IF hemoglobin\r\n7. IF any drugs used (except pencillins, vitamins, iron, or antinauseants), comment re teratogenicity? \r\n8. IF blood sugar elevated, discussion of diet with patient? \r\n9. Follow-up monthly for first 7 months, every 2 weeks during the 8th month, and then weekly until delivered? \r\n10. IF X-rays done, pregnancy related OR justification statement? ', 'Unknow'),
('PROSTATE CANCER', '0001-01-01 00:00:00', '1. Inquiry re urinary symptoms?\r\n2. Rectal exam at least yearly?\r\n3. Serum acid phosphatase yearly?\r\n4. IF new or changed urinary symptoms, C & S AND urinalysis?\r\n5. Pathology report positive?\r\n6. Follow-up every 6 months?', 'Unknow'),
('PROSTATE, BENIGN HYP', '0001-01-01 00:00:00', '1. Inquiry re urinary symptoms, at least one of following?\r\nnocturia \r\nfrequency\r\nstream\r\nurgency \r\n2. Description of prostate? \r\n3. Urinalysis? \r\n4. C & S? \r\n5. IF bladder distended, drained slowly? \r\n6. IF catheterized or obstructed, referral? ', 'Unknow'),
('PROSTATE, CANCER OF', '0001-01-01 00:00:00', '1. Inquiry re urinary symptoms? \r\n2. Rectal exam at least yearly? \r\n3. Serum acid phosphatase yearly? \r\n4. IF new or changed urinary symptoms, C & S AND urinalysis?\r\n5. Pathology report positive? \r\n6. Follow-up every 6 months? ', 'Unknow'),
('PROSTATITIS', '0001-01-01 00:00:00', '1. Inquiry re dysuria? \r\n2. Inquiry re pain? \r\n3. Prostate tender? \r\n4. Urinalysis? \r\n5. Urine C & S? \r\n6. Antibiotics used AND amount noted? \r\n7. Antibiotics used AND duration noted? \r\n8. Counselling re at least one of coffee, alcohol, smoking, spices? \r\n9. Follow-up within 2 weeks? ', 'Unknow'),
('PROSTATITIS CHRONIC', '0001-01-01 00:00:00', '1. Inquiry re at least 3 of following?\r\ndysuria\r\nfrequency\r\nperineal pain\r\npainful sexual activity\r\nurethral discharge\r\nlow back pain\r\nnocturia\r\n2. Abdominal exam?\r\n3. Rectal exam?\r\n4. Description of prostate (size and consistency)?\r\n5. Urine C & S?\r\n6. Septra\r\nOR\r\ntetracycline\r\nOR\r\nampicillin\r\nOR\r\nerythromycin used?\r\n7. Antibiotic used for at least 2 weeks?\r\n8. One follow-up?\r\n9. IF symptoms continue beyond one month\r\nOR\r\npyuria for more than one month\r\nOR\r\nbacteriuria for more than one month, consultation and/or referral?', 'Unknow'),
('PSORIASIS', '0001-01-01 00:00:00', '1. Inquiry re duration of lesions OR on chart (3 minute)?\r\n2. Description of lesions (scaly, size, psoriatic etc.) OR on chart (3 minute)? \r\n3. Location of lesions noted OR on chart (3 minute)? \r\n4. IF systemic steroids used, consultant''s note? \r\n5. IF antimitotic agents used, consultant''s note? \r\n6. Counselling OR on chart (3 minute)? ', 'Unknow'),
('PULMONARY EMPHYSEMA', '0001-01-01 00:00:00', '1. Inquiry re chest symptoms each visit, at least two of the following?\r\ncough\r\nsputum\r\nwheezing\r\ndyspnea\r\n2. CPE at least once in 2 years?\r\n3. ECG on chart (3 minute)? \r\n4. Chest X-ray at least once in 2 years?\r\n5. IF smoker, advice re smoking?\r\n6. Follow-up at least once yearly?', 'Unknow'),
('PYELONEPHRITIS, ACUT', '0001-01-01 00:00:00', '1. Inquiry re at least 3 of following? \r\nurinary frequency \r\nurinary urgency \r\nburning on urination (dysuria) \r\nlumbar back pain \r\nfever \r\nchills \r\n2. Presence/absence of fever noted? \r\n3. Presence/absence of lumbar (CVA) tenderness? \r\n4. Urinalysis AND micro? \r\n5. WBC? \r\n6. Urine C&S prior to treatment? \r\n7. Urine C&S positive? \r\n8. Antibiotic used AND was it one of penicillins, sulfonamides, Septra/Bactrim, cephalosporins, or tetracyclines? \r\n9. IF tetracycline used, was patient \r\n10. Was antibiotic used for 7 days or more initially? \r\n11. IF lab report indicates that organism not sensitive to initial antibiotic used, was antibiotic changed OR did physician indicate "patient better"? \r\n12. One follow-up within two weeks? \r\n13. Repeat urine C&S after treatment? ', 'Unknow'),
('PYELONEPHRITIS, CHRO', '0001-01-01 00:00:00', '1. Inquiry re 3 of following OR on chart (3 minute)? \r\nurinary frequency \r\nurinary urgency \r\nburning on urination (dysuria) \r\nlumbar back pain \r\nfever \r\nchills \r\n2. Blood pressure at least yearly? \r\n3. Urinalysis AND micro at least once in 2 years? \r\n4. Urine C&S at least once in 2 years? \r\n5. Urine C&S for acid-fast bacilli on chart (3 minute)? \r\n6. BUN OR creatinine at least once in 2 years? \r\n7. IVP on chart (3 minute)? \r\n8. Follow-up at least yearly? ', 'Unknow'),
('PYODERMA (INC. IMPET', '0001-01-01 00:00:00', '1. Site noted? \r\n2. IF oral antibiotic used, was it one of penicillins, erythromycins, sulfonamides, tetracyclines, or cephalosporins? \r\n3. IF tetracycline used, was patient ', 'Unknow'),
('RECTAL BLEEDING', '0001-01-01 00:00:00', '1. Inquiry re at least 2 of following? \r\namount \r\ntype of bleeding \r\nduration of bleeding \r\n2. Inquiry re bowel habits? \r\n3. Abdominal exam? \r\n4. Rectal exam? \r\n5. Hemoglobin within 1 week? \r\n6. Proctoscopic exam within 1 week? \r\n7. Sigmoidoscopic exam OR referral within 2 weeks? \r\n8. IF > 30, barium enema AND air contrast within 1 month? \r\n9. IF 30 years old or less AND no cause found on sigmoidoscopic, barium enema AND air contrast within 1 month? \r\n10. Barium enema AND/OR sigmoidoscopic exam within 1 month? \r\n11. IF no diagnosis established after 1 month, referral/consultation OR statement of justification? \r\n12. IF not hemorrhoids, one follow-up? ', 'Unknow'),
('REFLUX ESOPHAGITIS', '0001-01-01 00:00:00', '1. Inquiry re duration of symptoms? \r\n2. At least two of following present? \r\nheartburn with bending over recumbency \r\nwater brash \r\nintolerance to rich or spicy foods \r\nintolerance to alcohol \r\ndysphagia \r\nbelching \r\n3. Abdominal exam? \r\n4. IF dysphagia present, endoscopy? \r\n5. IF UGI series performed, reflux demonstrated? \r\n6. Advice re elevation of head of bed? \r\n7. Advice re diet (eg. avoid rich foods, spices, alcohol, coffee, tea, late meals, large meals,)? \r\n8. IF obesity noted, advice re weight reduction? ', 'Unknow'),
('RHEUMATIC HEAR DISEA', '0001-01-01 00:00:00', '1. Inquiry re at least one of following? \r\ndyspnea on exertion \r\neffort intolerance \r\nchest pain \r\nfatique \r\n2. Description of cardiac sounds, rhythm, murmurs? \r\n3. Blood pressure? \r\n4. IF available in the community, echocardiography? \r\n5. Chest X-ray on chart? \r\n6. IF prophylactic antibiotic used, was it one of the penicillins, cephalosporins, sulfonamides, erythromycins? \r\n7. Advice re antibiotic coverage for instrumentation procedures (eg. dental surgery, urology, gynecology)? ', 'Unknow'),
('RUBELLA', '0001-01-01 00:00:00', '1. Inquiry re at least one of following? \r\nfatigue enlarged glands \r\nmalaise rhinitis\r\nmyalgia conjunctivitis\r\nfever abdominal pain\r\nsore throat ear pain\r\n2. Inquiry re duration of symptom? \r\n3. Rash noted? \r\n4. Presence of posterior auricular nodes noted? ', 'Unknow'),
('SCARLET FEVER', '0001-01-01 00:00:00', '', 'Unknow'),
('SCOLIOSIS', '0001-01-01 00:00:00', '** NOTE **\r\nAudit only presenting visit. \r\n1. Inquiry re how condition found? \r\n2. Description of location (eg. thoracic, lumbar)? \r\n3. Description of extent (degree of angulation)? \r\n4. X-ray of affected area(s) of spine within 3 months of initial diagnosis? \r\n5. X-ray confirms diagnosis of scoliosis? \r\n6. IF 9 to 16 years old AND severe (angulation greater than or equal to 15 degrees, consultation OR referral? \r\n7. IF not referred, follow-up within 3 months? ', 'Unknow'),
('SECONDARY AMMENORRHE', '0001-01-01 00:00:00', '1. Menstrual history? \r\n2. Duration of problem? \r\n3. Description re onset of problem? \r\n4. History of medications (including oral contraceptives)? \r\n5. Inquiry re changes in diet? \r\n6. Inquiry re stress factors AND/OR athletics? \r\n7. Pelvic exam? \r\n8. Abdominal exam? \r\n9. Pregnancy test? \r\n10. CBC? \r\n11. Thyroid function (at least one of TSH,T3,T4)? \r\n12. Fasting blood sugar on chart (3 minute)? \r\n13. IF more than 3 months duration, prolactin? \r\n14. Pelvic ultrasound on chart (3 minute)? \r\n15. IF more than 3 months duration, X-ray of pituitary? \r\n16. Follow-up until cause found or referral? ', 'Unknow'),
('SEROUS OTITIS MEDIA', '0001-01-01 00:00:00', '1. Inquiry re at least two of following; hearing, pain, recurrent URI? \r\n2. Comment re fluid in middle ear OR retracted ear drum? \r\n3. Comment re nose AND throat? \r\n4. IF third episode or more, audiometry OR referral? \r\n5. IF physical findings OR hearing test are abnormal, follow-up until resolved OR referral? ', 'Unknow'),
('SINUSITIS', '0001-01-01 00:00:00', '1. Inquiry re pain in the face and/or head? \r\n2. Inquiry re nasal blockage? \r\n3. Presence/absence of fever noted? \r\n4. Presence/absence of tenderness over sinuses noted? \r\n5. IF recurrent (3 or more visits), X-ray of sinuses? \r\n6. Tenderness over sinuses OR positive X-ray of sinuses? \r\n7. IF antibiotic used, was it one of the penicillins, sulfonamides, erythromycins, cephalosporins, or tetracycline?\r\n8. IF tetracycline used, was patient ', 'Unknow'),
('SKIN ABSCESS', '0001-01-01 00:00:00', '1. Inquiry re location? \r\n2. Inquiry re recurrent or first attack? \r\n3. Description of size? \r\n4. Presence/absence of fluctuation? \r\n5. Presence/absence of lymphangitis? \r\n6. C & S of pus? \r\n7. IF recurrent, fasting serum glucose? \r\n8. Demonstration of pus? \r\n9. I & D? \r\n10. One follow-up within 10 days? ', 'Unknow'),
('SOAP', '0001-01-01 00:00:00', 'Subject:\n\nObject: \n\nAssessment: \n\nPlan:\n', '<table'),
('SPONTANEOUS ABORTION', '0001-01-01 00:00:00', '1. Date of LMP noted?\r\n2. Duration of LMP noted?\r\n3. Uterine cramps noted?\r\n4. Amount AND duration of vaginal bleeding?\r\n5. Passage of tissue?\r\n6. Pelvic exam with comment re cervix open or closed?\r\n7. Blood pressure?\r\n8. Pulse?\r\n9. Presence/absence of fever?\r\n10. Pregnancy test?\r\n11. Hemoglobin?\r\n12. Hematocrit?\r\n13. Rh factors?\r\n14. IF tissue available, specimen sent to lab?\r\n15. IF indicated by Rh factors, RHOGAM/Rh immune globulin?\r\n16. One follow-up within one month?', 'Unknow'),
('SPRAIN OR STRAIN, NY', '0001-01-01 00:00:00', '1. Inquiry re how injury happened? \r\n2. Inquiry re location of injury? \r\n3. Time of injury? \r\n4. Presence/absence of swelling? \r\n5. Presence/absence of tenderness? \r\n6. Presence/absence of hematoma? \r\n7. IF sports related, advice re prevention of further episodes? ', 'Unknow'),
('STASIS DERMATITIS', '0001-01-01 00:00:00', '1. Comment on location?\r\n2. Inquiry re duration?\r\n3. Presence/absence of varicose veins noted?\r\n4. Description of lesions?\r\n5. One follow-up within one month?', 'Unknow'),
('STOMATITIS, HERPETIC', '0001-01-01 00:00:00', '1. Inquiry re pain in mouth? \r\n2. Oral ulcerations noted? ', 'Unknow'),
('STOMATITIS, MONILIAL', '0001-01-01 00:00:00', '1. Inquiry re location AND duration of oral lesions? \r\n2. IF adult, inquiry re underlying cause (eg. antibiotics diabetes) OR this information on chart (3 minute)? \r\n3. Presence/absence of plaques in mouth noted? \r\n4. IF lesions unresolved within 2 weeks after therapy started, C & S of lesions for monilia? \r\n5. White plaques in mouth? \r\n6. Local antimonilial agent? \r\n7. Antibiotic used? \r\n8. Follow-up within 2 weeks? ', 'Unknow'),
('STREP THROAT', '0001-01-01 00:00:00', '1. Inquiry re sore throat?\r\n2. Inquiry re presence/absence of fever?\r\n3. Inquiry re cough?\r\n4. Throat exam?\r\n5. Presence/absence of cervical lymphadenopathy noted?\r\n6. Presence/absence of pharyngeal exudate noted?\r\n7. IF fever OR lymphadenopathy OR exudate OR enlarged tonsils, throat swab C & S?\r\n8. Antibiotic used AND was it one of the penicillins, erythromycins, or cephalosporins?\r\n9. IF antibiotic used AND patient antibiotic used for at least 7 days?\r\n10. One follow-up within two weeks?\r\n11. IF positive strep culture, antibiotics used?', 'Unknow'),
('STY', '0001-01-01 00:00:00', '1. Painful or swollen eyelid? ', 'Unknow'),
('SYNCOPE, NYD', '0001-01-01 00:00:00', '1. Inquiry re three of the following?\r\nrecurrent or initial episode predisposing factors (stress, pain, hyperventilation) description of event medications taken any associated injuries\r\n2. Inquiry re duration of unconsciousness? \r\n3. Neurological comments (eg. reflexes, pupils, movements)?\r\n4. Blood pressure?\r\n5. Presence/absence of hyperventilation noted?\r\n6. IF > 55 years, ECG?\r\n7. IF 2nd or more episode, blood sugar?\r\n8. IF 2nd or more episode, CBC?\r\n9. IF 2nd or more episode, EEG?\r\n10. IF 2nd or more episode, follow-up within 1 month OR referral?', 'Unknow'),
('SYPHILIS', '0001-01-01 00:00:00', '1. Inquiry re exposure?\r\n2. IF skin lesion present, inquiry re duration?\r\n3. IF primary syphilis, presence/absence of chancre noted?\r\n4. IF secondary syphilis, presence/absence of rash noted?\r\n5. Presence/absence of lymphadenopathy noted?\r\n6. VDRL OR STS?\r\n7. IF VDRL OR STS negative, repeated within 2 months?\r\n8. Swab for C & S for gonorrhea?\r\n9. IF antibiotic used, was it one of the penicillins, erythromycins, tetracyclines or spectinomycin?\r\n10. Notification of public health authorities?\r\n11. One follow-up within 2 months?', 'Unknow'),
('TENSION HEADACHE', '0001-01-01 00:00:00', '1. Inquiry re at least five of following? \r\nlocation of pain \r\nduration \r\ntime of onset \r\nfrequency \r\nassociated symptoms (nausea) \r\nfamily history \r\npsychosocial factors \r\n2. Blood pressure within last year? \r\n3. CPE, including neurological exam within last year? \r\n4. Headache is stress related? \r\n5. Stress factors identified AND counselling done? \r\n6. IF on medication, follow-up at least every 3 months? \r\n7. IF narcotic analgesic prescribed, dose AND duration recorded? ', 'Unknow'),
('THERAPEUTIC ABORTION', '0001-01-01 00:00:00', '1. Obstetrical history? \r\n2. Date of LMP noted? \r\n3. Parity noted? \r\n4. Pelvic exam, findings noted OR referral? \r\n5. Estimate of size of uterus OR weeks of preqnancy OR referral? \r\n6. Rh factor? \r\n7. Pregnancy test done? \r\n8. Pregnancy test positive? \r\n9. IF indicated by Rh factors, RHOGAM/Rh immune globulin? \r\n10. Admit for D & C OR referral? \r\n11. Family planning OR birth control counselling? \r\n12. One follow-up within 6 weeks after abortion? ', 'Unknow'),
('THREATENED ABORTION', '0001-01-01 00:00:00', '1. Date of LMP noted? \r\n2. Amount of vaginal bleeding? \r\n3. Duration of vaginal bleeding? \r\n4. Uterine cramps? \r\n5. IF heavy bleeding OR continued spotting for one week, pelvic exam? \r\n6. Pregnancy test? \r\n7. Hemoglobin? \r\n8. Hematocrit? \r\n9. Rh factors? \r\n10. Blood type? \r\n11. Positive pregnancy test? \r\n12. Bedrest advised? \r\n13. Progesterone or estrogen used? \r\n14. Follow-up at least once weekly while bleeding? ', 'Unknow'),
('THYROID NODULE', '0001-01-01 00:00:00', '1. Inquiry re location? \r\n2. Inquiry re duration? \r\n3. Inquiry re one of following? \r\npalpitations \r\ntremor \r\nweight loss \r\n4. Description of size of lesion? \r\n5. Comment on location (midline or lateral)? \r\n6. Referral OR thyroid function tests (T3 and T4 and TSH) AND I-131 uptake/thyroid scan OR ultrasound? \r\n7. Follow-up within 2 months, OR referral? ', 'Unknow'),
('TONSILLITIS, ACUTE', '0001-01-01 00:00:00', '1. Inquiry re sore throat?\r\n2. Description of tonsils?\r\n3. IF erythromycin, cephalosporin or sulfa used?\r\n4. IF > 4 years and cephalosporin, or sulfa used?\r\n5. IF >= 13 years, was penicillin, erythromycin,\r\ncephalosporin, sulfa, or tetracycline used?\r\n6. IF tetracycline used, was patient', 'Unknow'),
('TONSILLITIS, CHRONIC', '0001-01-01 00:00:00', '1. Inquiry re recurrent sore throat? \r\n2. Description of tonsils? \r\n3. Presence/absence of cervical glands noted? \r\n4. IF antibiotic used, was it one of the penicillins, erythromycins, cephalosporins, or tetracyclines? \r\n5. IF tonsillectomy OR referral, were there 4 or more episodes within 2 years OR peritonsillar abscess (quinsy) OR unilateral emlargement OR demonstrated hearing loss? \r\n6. IF tetracycline used, was patient ', 'Unknow'),
('TRANSIENT CEREBRAL I', '0001-01-01 00:00:00', '1. Inquiry re frequency?\r\n2. Inquiry re duration of each episode?\r\n3. Description of symptoms?\r\n4. Neurological exam with description of deficit?\r\n5. Blood pressure?\r\n6. Cardiovascular examination?\r\n7. Presence/absence of bruits in neck?\r\n8. ECG?\r\n9. IF male > 55 years, ASA prescribed as initial medication OR justification noted?\r\n10. IF ASA used, duration AND dosage recorded?\r\n11. IF two or more episodes, referral OR admission to hospital?\r\n12. IF smoker, advice re smoking?\r\n13. One follow-up within one month?\r\n14. Cause (eg. embolus, thrombosis) noted within one month OR referral?', 'Unknow'),
('TRIGEMINAL NEURALGIA', '0001-01-01 00:00:00', '1. Inquiry re severity of pain?\r\n2. Inquiry re duration of pain?\r\n3. Inquiry re facial pain?\r\n4. Inquiry re initiating stimuli?\r\n5. Neurological exam?\r\n6. IF Tegretol given, liver function tests within 6 weeks?\r\n7. Discussion re natural history of disease OR reassurance?\r\n8. One follow-up within 3 months?', 'Unknow'),
('UMBILICAL HERNIA', '0001-01-01 00:00:00', '*** Patient under 1 year old\r\n1. Well baby care visits?\r\n2. IF surgery done, was justification noted (eg. thin skin, too large, pain, ulceration)?', 'Unknow'),
('URETHRITIS, NYD', '0001-01-01 00:00:00', '1. Inquiry re urinary symptoms?\r\n2. Inquiry re sexual contacts OR injury?\r\n3. Comment re presence/absence of urethral discharge?\r\n4. Genital exam?\r\n5. Urinalysis AND micro?\r\n6. Urine C & S?\r\n7. IF discharge present, urethral swab C & S?\r\n8. VDRL OR STS?\r\n9. IF antibiotic used, was it one of the penicillins, erythromycins, sulfonamides, Septra/Bactrim, cephalosporins, or tetracyclines?\r\n10. One follow-up within 2 weeks?\r\n11. IF urine C & S OR urethral swab C & S still positive after antibiotic treatment, antibiotic changed?\r\n12. IF urine C & S OR urethral swab C & S positive, discussion re notification of sexual partner(s)?\r\n13. IF urethral swab C & S positive for gonorrhea or chlamydia, notification of public health authorities?', 'Unknow'),
('URI', '0001-01-01 00:00:00', '1. Complaint of at least one of the following?\r\nnasal discharge\r\nsore throat\r\nmalaise\r\ncold\r\n2. Duration of symptoms noted?\r\n3. IF cough in history, chest exam?\r\n4. IF patient\r\n5. IF sore throat in history, throat exam?\r\n6. IF narcotic antitussives prescribed, cough in history?\r\n7. IF antibiotics prescribed, was there history of secondary infection (coloured phlegm, or fever > 38 for 3 days or more)\r\nOR\r\nhigh risk (cardiac valvular disease or chronic pulmonary disease)?', 'Unknow'),
('URINARY TRACT INFECT', '0001-01-01 00:00:00', '1. Inquiry re duration of symptoms? \r\n2. Inquiry re first or recurring episode? \r\n3. Inquiry re at least two of following?\r\nfrequency \r\ndysuria \r\nhematuria\r\nfever \r\n4. Abdominal exam?\r\n5. Presence/absence of flank OR CVA tenderness noted? \r\n6. IF more than 2 infections within one year in female, vaginal exam? \r\n7. Urinalysis AND micro? \r\n8. Urine C & S? \r\n9. IF 3rd or more occurrence (3 minute) in female, IVP? \r\n10. IF 2nd or more occurrence (3 minute) in males, IVP? \r\n11. IF child AND 2nd or more occurrence in chart, voiding cysto-urethrogram? \r\n12. IF antibiotic used, was it one of penicillins, erythromycins, sulfonamides, cephalosporins, Septra/Bactrim, or tetracyclines? \r\n13. IF tetracycline used, was patient\r\n14. IF child OR discussion re causes of UTI''s? \r\n15. IF condition persists without definitive diagnosis for more than 3 months, referral? \r\n16. One follow-up within one month?', 'Unknow'),
('URTICARIA', '0001-01-01 00:00:00', '1. Inquiry re duration of rash? \r\n2. Inquiry re location of rash? \r\n3. Inquiry re possible cause (eg. diet, stress, medications)? \r\n4. Description of lesion? \r\n5. IF life threatening (eg. laryngeal edema, circulatory collapse), epinephrine used? \r\n6. IF systemic steroids used, duration \r\n7. IF recurrent (4 or more occasions), consultation OR referral? ', 'Unknow'),
('UTI', '0001-01-01 00:00:00', '1. Inquiry re duration of symptoms?\r\n2. Inquiry re first or recurring episode?\r\n3. Inquiry re at least two of following?\r\nfrequency\r\ndysuria\r\nhematuria\r\nfever\r\n4. Abdominal exam?\r\n5. Presence/absence of flank OR CVA tenderness noted?\r\n6. IF more than 2 infections within one year in female, vaginal exam?\r\n7. Urinalysis AND micro?\r\n8. Urine C & S?\r\n9. IF 3rd or more occurrence (3 minute) in female, IVP?\r\n10. IF 2nd or more occurrence (3 minute) in males, IVP?\r\n11. IF child AND 2nd or more occurrence in chart, voiding cysto-urethrogram?\r\n12. IF antibiotic used, was it one of penicillins, erythromycins, sulfonamides, cephalosporins, Septra/Bactrim, or tetracyclines?\r\n13. IF tetracycline used, was patient\r\n14. IF child\r\nOR\r\ndiscussion re causes of UTI''s?\r\n15. IF condition persists without definitive diagnosis for more than 3 months, referral?\r\n16. One follow-up within one month?', 'Unknow'),
('VAGINITIS, VULVITIS', '0001-01-01 00:00:00', '1. Inquiry re at least one of following; vaginal itch (pruritis) vulvar irritation, vaginal odour?\r\n2. Presence/absence of vaginal discharge?\r\n3. Vaginal exam?\r\n4. Vaginal AND/OR cervical C & S OR office examination of discharge in saline or KOH?\r\n5. IF Monilia (Candida) AND topical agent used, was it mystatin OR miconazole OR cotrimoxazole?\r\n6. IF Trichomonas AND systemic or topical agent used, was it metronidazole?\r\n7. IF Gardnerella AND systemic or topical agent used, was it metronidazole OR sulfonamide OR tetracycline?\r\n8. IF Trichomonas, discussion re simultaneous treatment of sexual partner?', 'Unknow'),
('VENEREAL WARTS (COND', '0001-01-01 00:00:00', '1. Inquiry re duration of lesions? \r\n2. Description of size AND extent of lesions? \r\n3. VDRL OR syphilis screen? ', 'Unknow'),
('VIRAL WARTS (VERRUCA', '0001-01-01 00:00:00', '1. Inquiry re duration of symptoms? \r\n2. Site(s) noted? \r\n3. Number noted? \r\n4. Electrodessication (cautery) of plantar warts on weight-bearing surfaces? \r\n5. Surgery on plantar warts? ', 'Unknow'),
('WELL BABY CARE', '0001-01-01 00:00:00', '1. Inquiry re food/diet? \r\n2. Inquiry re coping/parenting skills? \r\n3. Weight recorded at each visit? \r\n4. Comment re normal/abnormal developmental milestones? \r\n5. Length recorded 3 or more times per year? \r\n6. Head circumference recorded 3 or more times in first year of life? \r\n7. Three doses of DPTP by age 8 months OR justification of alternate course? \r\n8. IF age 1 to 2, MMR at 12-15 months, DPTP at 17-19 months OR justification of alternate course? \r\n9. IF > 1 year old, at least 3 visits in first year? \r\n10. IF > 2 years old, at least 3 visits in second year? \r\n11. IF parenting problems identified, counselling OR referral? \r\n12. MMR given before 12 months of age? ', 'Unknow');
